	var mainSaturation = Math.round(mainHSL[1] * 10000) / 100;
	var mainLum = Math.round(mainHSL[2] * 10000) / 100;

	var secondaryColor1 = hslToHex(mainHue + 2, Math.max(mainSaturation - 50.77, 30), Math.min(mainLum + 11.97, 50));
