	document.body.style.setProperty('--secondaryColor1', secondaryColor1);

	var secondaryColorLose = hslToHex(mainHue - 1, Math.max(mainSaturation - 7.57, 10), Math.min(mainLum + 5.97, 45));
	//90.3, 24.3);
	document.body.style.setProperty('--secondaryColorLose', secondaryColorLose);
	var secondaryColorPause = hslToHex(mainHue + 1, Math.max(mainSaturation - 7.57, 10), Math.min(mainLum + 5.97, 45));
