var dtForParticles = -1;
class WinParticle {
	constructor(x, y, size, speedX, speedY, idxImg, angleInRadians) {
		this.x = x;
		this.y = y;
		this.rotatedX = this.x;
		this.rotatedY = this.y;
		this.size = size;
		this.speedX = speedX;
		this.speedY = speedY;
		this.idxImg = idxImg;
		this.angleInRadians = angleInRadians;
		this.cos = Math.cos(-this.angleInRadians);
		this.sin = Math.sin(-this.angleInRadians);
	}
	update() {
		if (dtForParticles <= 0)
			return;

		this.rotatedX += this.speedX * dtForParticles;
		this.rotatedY += this.speedY;
		var change = 3;
		if (this.rotatedY < particleHMinLim) {
			change = 2;
		} else if (this.speedY < 0)
			change = 0.7;

		this.speedY += change * particleIncRatio;
		this.x = this.rotatedX * this.cos - this.rotatedY * this.sin;
		this.y = this.rotatedX * this.sin + this.rotatedY * this.cos;
		this.idxImg = this.idxImg + dtForParticles;
		if (this.idxImg >= animFrameCount)
			this.idxImg = 0;

	}
	draw() {
		ctx.save();
		ctx.rotate(this.angleInRadians);
		var sprite = mSprites[Math.floor(this.idxImg)];
		var paddingLeft = sprite.paddingLeftScaled;
		var paddingTop = sprite.paddingTopScaled;
		ctx.drawImage(coinImage, sprite.x, sprite.y, sprite.width, sprite.height, this.x + paddingLeft, this.y + paddingTop, particleW, particleH);
		ctx.restore();
	}
}

function resizeCanvas() {
	if (canvas == undefined)
		return;

	var hyperspinOverlay = document.getElementById("hyperspinOverlay");
	var computedStyle = window.getComputedStyle(hyperspinOverlay, null);
	var maxH = computedStyle.getPropertyValue('height');
	maxH = Math.ceil(parseFloat(maxH)) * devicePixelRatio;
	var maxW = computedStyle.getPropertyValue('width');
	maxW = Math.ceil(parseFloat(maxW)) * devicePixelRatio;
	canvas.width = maxW;
	canvas.height = maxH;

	var containerW = devicePixelRatio * row_width
	ratioForParticleSpeedY = canvas.height * 0.098;

	particleHMaxLim = maxH + 100 * window.devicePixelRatio;
	particleHMinLim = maxH * 0.4;

	coinSpeedRatioY = 0.0016 * maxH;
	coinSpeedRatioX = containerW * 0.04;

}

function createExplosion(x, y, multiplierIdx) {
	const countArray = [4, 7, 10, 15];
	const particleCount = countArray[multiplierIdx];

	const xSpreadArr = [10, 7, 5, 3];
	var xSpread = devicePixelRatio * row_width / xSpreadArr[multiplierIdx];
	for (let i = 0; i < particleCount; i++) {
		const size = particleW;
		const speedX = (-7 + Math.random() * 14) * coinSpeedRatioX;
		const speedY = (-15 - (Math.random() + 1) * 3) * coinSpeedRatioY;
		var px = x + xSpread * (Math.random() * 2 - 1);
		var py = y - (40 + Math.random() * 10) * window.devicePixelRatio;
		var imgIdx = Math.floor(Math.random() * 16);
		//var angleInRadians = Math.PI/4 + Math.random() * Math.PI/2;
		var angleInRadians = 0.5 + Math.random() * 2.3;
		particles.push(new WinParticle(px,py,size,speedX,speedY,imgIdx,angleInRadians));
	}
}

var mustClearRect = false;
function animate() {
	if (mustClearRect) {
		ctx.clearRect(0, 0, canvas.width, canvas.height);
		mustClearRect = false;
	}

	if (!inHyperplay)
		particles = [];

	var len = particles.length;
	var i = len;
	while (i--) {
		var particle = particles[i];
		if (particle.rotatedY >= particleHMaxLim) {
			particles.splice(i, 1);
			continue;
		}

		particle.update();
		particle.draw();
	}

	if (particles.length > 0)
		mustClearRect = true;

	dtForParticles = -1;
	requestAnimationFrame(animate);
}
