var oSoundFXOn = false;
var HyperplaySound = function(snd, forceLoop) {
	if (!oSoundFXOn || oSoundVolume <= 0)
		return undefined;
	if (!window.inHyperplay)
		return undefined;

	if (HP_SOUNDS[snd] == undefined)
		return;
	var sndName = HP_SOUNDS[snd].name;
	if (sndName == undefined)
		return undefined;

	var isLoop = forceLoop == true ? 1 : 0;
	var options = {
		interrupt: createjs.Sound.INTERRUPT_NONE,
		loop: isLoop
	};
	options.volume = HP_SOUNDS[snd].volume;
	var obj = createjs.Sound.play(sndName, options);
	return obj;
};

var isReady = function() {
	for (i in ready) {
		if (!ready[i]) {
			return false;
		}
	}
	return true;
}

var canProcessNextResponse = function() {
	for (i in ready) {
		if (i == CHECK.ROUNDEND)
			continue;

		if (!ready[i]) {
			return false;
		}
	}

	return true;
}

var processNextResponse = function() {
	if (responseQueue.length == 0) {
		if (mustHandleFSStart)
			handleFSStartInHP();
		return;
	}

	if (!setupDone)
		return;

	var response = responseQueue.shift();
	//console.log("HYPERPLAY: process next from queue");
	processResponse(response);
}

