var OnHPSoundDecoded = function(processor) {
	createjs.Sound._idHash[processor.id] = {
		src: processor.url
	};
	createjs.Sound.activePlugin._soundInstances[processor.url] = [];
	createjs.Sound.activePlugin._audioSources[processor.url] = processor.audioSource;
}

const generateHash = (string) => {
	let hash = 0;
	for (const char of string) {
		hash = (hash << 5) - hash + char.charCodeAt(0);
		hash |= 0;
		// Constrain to 32bit integer
	}
	return hash;
}
;

var addAudioProcessor = function(sndIDX) {
	if (HP_SOUNDS[sndIDX] == undefined)
		return;
	var base64data = HP_SOUNDS[sndIDX].base64;
	if (base64data == undefined)
		return;

	var id = "s" + generateHash(base64data);
	HP_SOUNDS[sndIDX].name = id;
	var processor = new SoundLoader.AudioProcessor({
		id: id,
		url: id + "." + SoundHelper.AudioFormat.mp3,
		base64: base64data,
		handler: new EventHandler(this,OnHPSoundDecoded),
		context: createjs.Sound.activePlugin.context
	});

	processor.ProcessWebAudio();
}

var addSounds = function() {
	if (SoundLoader.sounds.length == 0) {
		setTimeout(addSounds, 300);
		return;
	}

	for (var i in HP_SOUNDS)
		addAudioProcessor(i);
}

var settingSliders = {};
var handleSlider = function(slider) {
	if (slider == undefined)
		return;

	if (slider.values.length == 0)
		return;

	var max = slider.values.length > 1 ? slider.values.length - 1 : 1;
	var percent = 2.8 + Math.floor(97.2 * (slider.el.value - 1) * 100 / max) / 100;
	//slider.el.style.background = `linear-gradient(to right, var(--secondaryColorSlider)  0%, var(--secondaryColorSlider) ${percent}%, #000 ${percent}%, #000 100%)`;
	slider.el.style.setProperty('--' + slider.propertyName, percent + "%");
}

var handleMarginValues = function(sliderType, newIdx, maxIdx) {
	var otherBtn1 = undefined;
	var otherBtn2 = undefined;
	var marginBtn = undefined;
	if (newIdx == 0) {
		marginBtn = document.getElementById("decrease" + sliderType);
		otherBtn1 = document.getElementById("increase" + sliderType);
	} else if (newIdx == maxIdx) {
		marginBtn = document.getElementById("increase" + sliderType);
		otherBtn1 = document.getElementById("decrease" + sliderType);
	} else {
		otherBtn1 = document.getElementById("decrease" + sliderType);
		otherBtn2 = document.getElementById("increase" + sliderType);
	}

	if (marginBtn)
		marginBtn.classList.add("transparent");

	if (otherBtn1)
		otherBtn1.classList.remove("transparent");

	if (otherBtn2)
		otherBtn2.classList.remove("transparent");
}

class SettingSlider {
	constructor(_propertyName, _el) {
		this.values = [];
		this.el = _el;
		this.propertyName = _propertyName;
	}
	update(value) {
		var found = false;

		for (var i in this.values) {
			if (this.values[i] == value) {
				var sliderType = "";
				if (this.propertyName == "percentSpin")
					sliderType = "Spins";
				else
					sliderType = "Bet";

				indexVals[sliderType] = i;

				if (this.el != undefined)
					this.el.value = +i + 1;

				handleMarginValues(sliderType, i, this.values.length - 1);

				found = true;
				break;
			}
		}

		if (!found || this.el == undefined)
			return;
		handleSlider(this);
		if (sliderType == "Bet")
			UpdateAnteBetOptionsCostForHP();
	}
}

var betUnderMinBet = function() {
	return inHyperplay && IsRequired("HPMSB") && XT.GetBool("BetUnderMinSpinBet");
}

var setBetToValue = function(targetBet) {
	HPVARS.betsSetupDone = false;
	var currentBet = CoinManager.GetNextTotalBet();
	var lastBet = currentBet;
	if (targetBet > currentBet) {
		do {
			CoinManager.instance.GetSmartIncreasedBet(true);
			tmpBet = CoinManager.GetNextTotalBet();
			if (tmpBet == targetBet || tmpBet == lastBet) {
				betValue.innerHTML = LocaleManager.FormatValue(targetBet, new FormatOptions());
				break;
			}

			lastBet = tmpBet;
		} while (true);

	} else if (targetBet < currentBet) {
		do {
			CoinManager.instance.GetSmartDecreasedBet(true);
			tmpBet = CoinManager.GetNextTotalBet();
			if (tmpBet == targetBet || tmpBet == lastBet) {
				betValue.innerHTML = LocaleManager.FormatValue(targetBet, new FormatOptions());
				break;
			}

			lastBet = tmpBet;
		} while (true);
	}

	HPVARS.betsSetupDone = true;
	UpdateAnteBetOptionsCostForHP();
}

var initBetValues = function() {
	var tempUILPPT = UILabel.prototype.processPixiText;
	UILabel.prototype.processPixiText = function() {}

	var tempFPM_UFS;
	if (window["FeaturePurchaseManager"]) {
		tempFPM_UFS = FeaturePurchaseManager.prototype.UpdateFeatureState;
		FeaturePurchaseManager.prototype.UpdateFeatureState = function() {}
	}

	settingSliders["Bet"].values = [];
	var bkupBet = CoinManager.GetNextTotalBet();
	var lastBet = bkupBet;

	HPVARS.betsSetupDone = false;
	if (betUnderMinBet()) {
		do {
			CoinManager.instance.GetSmartIncreasedBet(true);
			CoinManager.instance.UpdateBetValues();
			bkupBet = CoinManager.GetNextTotalBet();
		} while (XT.GetBool("BetUnderMinSpinBet"));
	}

	if (lastBet != bkupBet)
		betToRestore = lastBet;

	lastBet = bkupBet;
	var tmpBet = bkupBet;

	do {
		CoinManager.instance.GetSmartDecreasedBet(true);
		if (betUnderMinBet()) {
			CoinManager.instance.GetSmartIncreasedBet(true);
			break;
		}
		tmpBet = CoinManager.GetNextTotalBet();
		if (tmpBet == lastBet || tmpBet == undefined) {
			if (tmpBet == undefined)
				CoinManager.instance.GetSmartIncreasedBet(true);
			break;
		}
		lastBet = tmpBet;
	} while (true);

	settingSliders["Bet"].values.push(lastBet);
	do {
		CoinManager.instance.GetSmartIncreasedBet(true);
		tmpBet = CoinManager.GetNextTotalBet();
		if (tmpBet == lastBet || tmpBet == undefined)
			break;

		settingSliders["Bet"].values.push(tmpBet);
		lastBet = tmpBet;
	} while (true);

	do {
		if (tmpBet == bkupBet)
			break;
		CoinManager.instance.GetSmartDecreasedBet(true);
		if (betUnderMinBet())
			break;

		if (CoinManager.GetNextTotalBet() == tmpBet)
			break;
		tmpBet = CoinManager.GetNextTotalBet();
	} while (true);

	if (settingSliders["Bet"].values.length == 0)
		return;

	UILabel.prototype.processPixiText = tempUILPPT;
	if (tempFPM_UFS != undefined)
		FeaturePurchaseManager.prototype.UpdateFeatureState = tempFPM_UFS;

	if (bkupBet > settingSliders["Bet"].values[0]) {
		CoinManager.instance.GetSmartDecreasedBet(true);
		CoinManager.instance.GetSmartIncreasedBet(true);
	} else {
		CoinManager.instance.GetSmartIncreasedBet(true);
		CoinManager.instance.GetSmartDecreasedBet(true);
	}

	CoinManager.instance.UpdateBetValues();

	HPVARS.betsSetupDone = true;
	betValue.innerHTML = LocaleManager.FormatValue(bkupBet, new FormatOptions());

	var betSliderEl = document.getElementById("betSlider");
	if (betSliderEl == undefined)
		return;

	betSliderEl.min = 1;
	betSliderEl.max = settingSliders["Bet"].values.length;
	settingSliders["Bet"].update(bkupBet);
}

var initBetSlider = function() {
	var betSliderEl = document.getElementById("betSlider");
	if (betSliderEl == undefined)
		return;
	if (settingSliders["Bet"] == undefined) {
		settingSliders["Bet"] = new SettingSlider("percentBet",betSliderEl);

		betSliderEl.oninput = function() {
			if (settingSliders["Bet"].values.length == 0)
				return;

			indexVals["Bet"] = this.value - 1;

			handleMarginValues("Bet", indexVals["Bet"], settingSliders["Bet"].values.length - 1);
			var targetBet = settingSliders["Bet"].values[indexVals["Bet"]];
			setBetToValue(targetBet);

			handleSlider(settingSliders["Bet"]);
		}
	}

	if (hasCoinsBackup == undefined && XT.GetBool(Vars.HasCoins)) {
		hasCoinsBackup = XT.GetBool(Vars.HasCoins);
		XT.SetBool(Vars.HasCoins, false);
	}

	initBetValues();
}

var spinValues = [10, 20, 30, 50, 70, 100, 500, 1000];
var initSpinSlider = function() {
	var spinSliderEl = document.getElementById("spinSlider");
	settingSliders["Spins"] = new SettingSlider("percentSpin",spinSliderEl);

	var ctrls = undefined;
	if (window["AutoplayControllerMobileV10"])
		ctrls = globalRuntime.sceneRoots[1].GetComponentsInChildren(AutoplayControllerMobileV10, true)

	if (ctrls != undefined && ctrls.length > 0) {
		var lim = IsRequired("LIMAP")

		function isAllowed(value) {
			if (lim && lim[0]) {
				var maxAPs = lim[0] | 0;
				return value <= maxAPs;
			}
			return true;
		}

		if (ctrls.length > 0)
			spinValues = ctrls[0].sliderSpins.values.filter(isAllowed);

	}

	maxSpins = spinValues[spinValues.length - 1];
	if (isNaN(maxSpins)) {
		if (spinValues.length > 1)
			maxSpins = spinValues[spinValues.length - 2];
		else
			maxSpins = 1000;
		spinValues[spinValues.length - 1] = maxSpins + 1;
	} else if (maxSpins >= 1000)
		spinValues.push(maxSpins + 1);

	settingSliders["Spins"].values = spinValues;
	spinSliderEl.min = 1;
	spinSliderEl.max = settingSliders["Spins"].values.length;

	var spinsReq = XT.GetInt(Vars.AutoplaySpinsRequested);
	if (spinsReq <= 0)
		spinsReq = Math.min(maxSpins, spins);

	for (i in spinValues) {
		if (spinValues[i] == spinsReq) {
			indexVals["Spins"] = i;
			break;
		}
	}

	spins = spinsReq;

	spinSliderEl.oninput = function() {
		indexVals["Spins"] = this.value - 1;
		handleMarginValues("Spins", indexVals["Spins"], settingSliders["Spins"].values.length - 1);
		spins = settingSliders["Spins"].values[indexVals["Spins"]];
		var val;
		if (spins > maxSpins)
			val = '';
		else
			val = spins;

		spinsValue.innerHTML = val;
		handleSlider(settingSliders["Spins"]);
	}

	updateSpinValue();
}

HPVARS.anteBetLabels = [];
HPVARS.anteBetDesc = [];

var UpdateAnteBetOptionsCostForHP = function() {
	if (!HPVARS.mustUpdateAnteValuesOnBetChanged)
		return;

	if (!HPVARS.betsSetupDone || !inHyperplay)
		return;

	if (betLevelManager == undefined)
		return;

	for (var i in betLevelManager.betLevelOptions) {
		if (i == 0)
			continue;
		HPVARS.anteBetLabels[i] = betLevelManager.betLevelOptions[i].cost[0].text;
	}

	var anteBetDiv = document.getElementById("anteBet");
	var selectItemsDiv = getElementFromDiv(anteBetDiv, "select-items");
	if (selectItemsDiv == undefined)
		return;

	var options = selectItemsDiv.children;
	for (var i = 1; i < options.length; i++) {
		var option = options[i];
		var text = HPVARS.anteBetLabels[i];
		if (text == option.innerHTML)
			continue;

		HPVARS.antebetsChanged = true;
		option.innerHTML = text;
		if (option.className.indexOf("same-as-selected") >= 0) {
			var selected = getElementFromDiv(anteBetDiv, "select-selected");
			selected.innerHTML = text;
		}
	}
}

var UpdateAnteBetSetting = function() {
	var anteBetDiv = document.getElementById("anteBet");
	if (anteBetDiv == undefined)
		return;

	var selectItemsDiv = getElementFromDiv(anteBetDiv, "select-items");
	if (selectItemsDiv == undefined)
		return;

	var options = selectItemsDiv.children;
	var enabledCount = 0;
	for (var i in HPVARS.anteBetsEnabled) {
		if (HPVARS.anteBetsEnabled[i]) {
			options[i].style.display = "";
			enabledCount++;
		} else {

			options[i].style.display = "none";

			if (options[i].className.indexOf("same-as-selected") >= 0) {
				var selected = getElementFromDiv(anteBetDiv, "select-selected");
				options[0].click();
			}
		}
	}

	var topVal = -(100 * enabledCount + 15);
	selectItemsDiv.style.top = topVal + "%";
}

var UpdateAnteBetActiveOptionsHP = function() {
	HPVARS.anteBetsEnabled = {};
	HPVARS.firstAnteBetEnabled = 0;

	if (betLevelManager == undefined)
		return;

	for (var i in betLevelManager.betLevelOptions) {
		if (i == 0)
			continue;
		var option = betLevelManager.betLevelOptions[i];
		HPVARS.anteBetsEnabled[i] = option.isEnabled && !option.isHidden;
		if (HPVARS.firstAnteBetEnabled == 0 && HPVARS.anteBetsEnabled[i])
			HPVARS.firstAnteBetEnabled = i;
	}

	HPVARS.anteBetsEnabled[0] = true;
	UpdateAnteBetSetting();

	if (HPVARS.anteBetOptionsCount == 1 && HPVARS.firstAnteBetEnabled > 1 && !HPVARS.mustUpdateAnteValuesOnBetChanged) {
		var anteTitle = document.getElementById("anteBetTitle");
		anteTitle.innerHTML = HPVARS.anteBetLabels[HPVARS.firstAnteBetEnabled];
	}
}

var initBetLevelManager = function() {
	if (window["BetLevelManager"] != undefined) {
		if (betLevelManager == undefined)
			betLevelManager = globalRuntime.sceneRoots[1].GetComponentsInChildren(window["BetLevelManager"], true)[0];
	} else if (window["BetLevelV2"] != undefined) {
		if (betLevelManager == undefined) {
			betLevelManager = globalRuntime.sceneRoots[1].GetComponentsInChildren(window["BetLevelV2"], true)[0];
		}
	}

	if (betLevelManager == undefined)
		return;

	if (HPVARS.mustUpdateAnteValuesOnBetChanged && HPVARS.obL2_UPC == undefined) {
		HPVARS.obL2_UPC = BetLevelV2.prototype.UpdateOptionsCost;
		BetLevelV2.prototype.UpdateOptionsCost = function() {
			HPVARS.obL2_UPC.apply(this, arguments);
			UpdateAnteBetOptionsCostForHP();
		}
	}

	if (betLevelManager.multiAnteBetOptions && window["BetLevelV2"] != undefined && HPVARS.obL2_UAO == undefined) {
		HPVARS.obL2_UAO = BetLevelV2.prototype.UpdateActiveOptions;
		BetLevelV2.prototype.UpdateActiveOptions = function() {
			HPVARS.obL2_UAO.apply(this, arguments);
			UpdateAnteBetActiveOptionsHP();
		}
	}

	if (betLevelManager.multiAnteBetOptions) {
		for (var i = 1; i < betLevelManager.betLevelOptions.length; i++)
			if (!betLevelManager.betLevelOptions[i].IsHidden()) {
				HPVARS.anteBetIdx = i;
				HPVARS.anteBetOptionsCount++;
			}
	}

	if (HPVARS.anteBetOptionsCount > 0 && HPVARS.anteBetRootPath != undefined) {
		UpdateAnteBetOptionsCostForHP();

		for (var i in HPVARS.anteBetLabelsPaths) {
			if (HPVARS.anteBetLabelsPaths[i] == "") {
				HPVARS.anteBetLabels[i] = hyperTexts.anteBetText[langIDX];
				continue;
			}

			if (HPVARS.mustUpdateAnteValuesOnBetChanged) {
				HPVARS.anteBetLabels[i] = betLevelManager.betLevelOptions[i].cost[0].text;
				continue;
			}

			var t = globalRuntime.sceneRoots[1].transform.Find(HPVARS.anteBetRootPath + HPVARS.anteBetLabelsPaths[i]);
			HPVARS.anteBetLabels[i] = "";
			if (t == null)
				continue;
			var labels = t.GetComponentsInChildren(UILabel, true);
			if (labels.length > 0) {
				HPVARS.anteBetLabels[i] = labels[0].text.replace("\n", " ");
			}
		}

		for (var i in HPVARS.anteBetDescPaths) {
			HPVARS.anteBetDesc[i] = "";
			if (HPVARS.anteBetDescPaths[i].length == 0)
				continue;
			var t = globalRuntime.sceneRoots[1].transform.Find(HPVARS.anteBetRootPath + HPVARS.anteBetDescPaths[i]);
			if (t == null)
				continue;
			var labels = t.GetComponentsInChildren(UILabel, true);
			if (labels.length > 0)
				HPVARS.anteBetDesc[i] = labels[0].text.replace("\n", " ");
		}
	}
}

