var stillProcessing = function() {
	var moreInQ = responseQueue.length > 0 || roundsToProcess.length > 0;
	return !isReady() || moreInQ || testIndex < inputJson.length || (roundsCount[PROCESSED] < totalSpinsCount[SPUN]);
}

var addCustomLine = function(className) {
	var linePayload = `<div class=${className}></div>`;
	var htmlContent = new DOMParser().parseFromString(linePayload, "text/html");
	var div = table.insertBefore(htmlContent.body.firstChild, table.children[0]);
	var extraData = new Spin(spinIndex++,0,0,-1,0,0,"","","","","");
	extraData.div = div;
	extraData.height = line_height;
	sessionData.push(extraData);
}

var addStartCredit = function() {
	var balance = XT.GetDouble(Vars.BalanceReceived) + XT.GetDouble(Vars.BonusBalanceReceived);
	var balanceStr = LocaleManager.FormatValue(balance, new FormatOptions());

	var startingCreditsEl = undefined;
	for (var i = 0; i < table.children.length; i++) {
		var child = table.children[i];
		if (child.className.indexOf("Row") < 0)
			continue;

		if (child.className.indexOf("StartingCreditsAgain") >= 0)
			startingCreditsEl = child;
		break;
	}

	if (startingCreditsEl) {
		var label = getElementFromDiv(startingCreditsEl, "StartingCreditsLabel");
		if (label != undefined) {
			var creditsEl = getElementFromDiv(startingCreditsEl, "CreditsValue");
			setLastCredit(balance);
			creditsEl.innerHTML = balanceStr;
			fitCreditsInDiv(startingCreditsEl, -1);
			return;
		}
	}

	removeLine(0);
	thinLines = [null, null];
	addCustomLine("whiteLine");
	var payload = `
		<div class= "Row expanded loseFirstRow StartingCreditsAgain">
			<div class="RowContent contentExpanded">
				<div class="StartingCreditsLabel">${hyperTexts.startingCredit[langIDX]}</div>
				<div class="Credits">
					<div class="CreditsValue">${balanceStr}</div>
				</div>
			</div>
		</div>
		`

	var htmlContent = new DOMParser().parseFromString(payload, "text/html");
	var div = table.insertBefore(htmlContent.body.firstChild, table.children[0]);
	var extraData = new Spin(spinIndex++,0,0,-1,0,0,"","","","","");
	extraData.div = div;
	extraData.height = row_height;
	sessionData.push(extraData);
	fitCredits(extraData, -1);
	addCustomLine("whiteLine");
}

var addEndCredit = function() {
	HyperplaySound("end_credit");

	var balance = XT.GetDouble(Vars.BalanceReceived) + XT.GetDouble(Vars.BonusBalanceReceived);
	var balanceStr = LocaleManager.FormatValue(balance, new FormatOptions());

	addCustomLine("whiteLine");
	var creditPayload = `
		<div class= "Row loseFirstRow">
			<div class="RowContent contentExpanded">
				<div class="StartingCreditsLabel">${hyperTexts.endCredit[langIDX]}</div>
				<div class="Credits">
					<div class="CreditsValue">${balanceStr}</div>
				</div>
			</div>
			</div>
		`
	var htmlContent = new DOMParser().parseFromString(creditPayload, "text/html");
	var div = table.insertBefore(htmlContent.body.firstChild, table.children[0]);
	var extraData = new Spin(spinIndex++,0,0,-1,0,0,balanceStr,"","","","");
	extraData.div = div;
	extraData.height = row_height;
	sessionData.push(extraData);

	beforeTransitionH(div);
	div.classList.toggle("expanded");
	fitCredits(extraData, -1);

	addCustomLine("whiteLine");
}

var pauseRowAddded = false;
var roundTrackedIndex = 0;
var userPaused = false;

var clearUnfinisedRound = function() {
	if (roundsToProcess.length == 1) {
		if (roundsToProcess[0]["waitRoundEnd"] == undefined) {
			setReady(CHECK.AUTOSPIN);
			roundsToProcess = [];
		}
	}

	pauseFirstRow();
}

var pauseFirstRow = function() {
	if (stillProcessing()) {
		mustPause = true;
		return;
	}

	if (pauseRowAddded)
		return;
	if (!isPaused && !mustPause)
		return;

	if (userPaused) {
		var newRoundsCount = roundsCount[SPUN] - roundTrackedIndex;
		globalTracking.SendEvent("uht_hyperplay", "Paused_After", newRoundsCount, "BehaviourTracker");
	}
	roundTrackedIndex = roundsCount[SPUN];
	userPaused = false;

	requestWinnings();
	setPlayingStatus(PLAYING_STATUS.PAUSED);
	resetTopVisibleIndex();
	mustPause = false;
	updateLatestBetSet();
	updateGameMode();

	if (table.children.length > 0 && table.children[0].className.indexOf("bgPause") > -1) {
		console.log("HYPERPLAY already paused");
		return;
	}

	removeLine(0);
	removeLine(1);

	toggleFirstRow(lastSpin, true);

	if (isSessionDone()) {
		addEndCredit();
		currentSpinsCount[SPUN] = 0;
		currentSpinsCount[PROCESSED] = 0;
		//setTimeout(startSession, 3000);
	} else {
		if (pauseDiv == undefined) {
			var rowPayload = `
				<div class="Row bgPause">
					<div id="pauseBarPart1"></div>
				</div>
			`;
			var htmlContent = new DOMParser().parseFromString(rowPayload, "text/html");
			pauseDiv = htmlContent.body.firstChild;
		} else
			pauseDiv.className = "Row bgPause";

		table.insertBefore(pauseDiv, table.children[0]);
		beforeTransitionH(pauseDiv);
		pauseDiv.classList.toggle("expanded");

		console.log("HYPERPLAY pause row added; spun: " + totalSpinsCount[SPUN]);
	}

	lastSpin = undefined;
	firstRow = undefined;
	pauseRowAddded = true;
}

var setExtraTextColor = function(spin, isBlack) {
	var row = spin.div;
	var color = isBlack ? "#000000" : "#FFFFFF";
	var spinIndexEl = getElementFromDiv(row, "SpinIndex");
	var multiplier = getElementFromDiv(row, "WinMultiplier");
	var fsEl = getElementFromDiv(row, "FreeSpins");

	if (spinIndexEl) {
		if (!isBlack) {
			if ((spin.tumblingState == "TumbleStart" && !spin.collapsed) || (spin.tumblingState == "TumbleEnd" && spin.collapsed) || spin.tumblingState == "")
				spinIndexEl.style.color = color;
			else
				spinIndexEl.style.color = "#ffffff4c";
		} else
			spinIndexEl.style.color = color;
	}
	if (multiplier)
		multiplier.style.color = color;
	if (fsEl)
		fsEl.style.color = color;
}

var setTextColor = function(spin, winType, isBlack) {
	var row = spin.div;
	var creditsEl = getElementFromDiv(row, "CreditsValue");
	setExtraTextColor(spin, isBlack);

	if (isBlack) {
		row.style.color = "#000000";
		creditsEl.style.color = "#000000";
	} else {
		if (winType >= RESULT_TYPE.SMALL_WIN) {
			if (spin.tumblingState == "TumbleStart")
				creditsEl.style.color = "#ffffff4c";
			else
				creditsEl.style.color = "#FFFFFF";

			row.style.color = "#FFFFFF";
		} else {
			if (spin.tumblingState == "TumbleEnd" || spin.freeSpinState == "LastFreeSpin")
				creditsEl.style.color = "#FFFFFF";
			else
				creditsEl.style.color = "#ffffff4c";

			row.style.color = "#ffffff4c";
		}
	}
}

var toggleBlack = function(spin, winType, enable) {
	if (spin.div == null)
		return;
	var row = spin.div.children[0];
	if (row == undefined)
		return;

	row.style.transition = "";
	//rowTransition + bgTransition;
	var bgState = getElementFromDiv(row, "BGState");
	if (bgState == undefined)
		return;
	var spinState = getElementFromDiv(row, "SpinState");

	var toAdd = "bigMultiplier";
	var toRemove = "bigMultiplier";
	if (enable) {
		toAdd += "Black";
		//TODO -> make gold bg if it doesn't have it!
	} else
		toRemove += "Black";

	var betMultiplierEl = getElementFromDiv(row, "BetMultiplierVal");
	if (betMultiplierEl.className.indexOf(toRemove) > -1) {
		betMultiplierEl.classList.remove(toRemove);
		betMultiplierEl.classList.add(toAdd);
	}

	if (enable) {
		if (bgState.classList.length > 1 && !bgState.className.endsWith("Black"))
			bgState.className = bgState.className + "Black";

		if (spinState.classList.length > 1 && !spinState.className.endsWith("Black"))
			spinState.className = spinState.className + "Black";

	} else {
		//bgState.style.transition = "background 1s";
		bgState.className = bgState.className.replace("Black", "");

		//spinState.style.transition = "background 1s";
		spinState.className = spinState.className.replace("Black", "");
	}

	setTextColor(spin, winType, enable);
}

var testDiv = undefined;
var getWidthFor = function(str, fontSize, div) {
	var fontName, fontWeight;
	if (div) {
		var computedStyle = window.getComputedStyle(div, null);
		fontName = computedStyle.getPropertyValue('font-family');
		fontWeight = computedStyle.getPropertyValue('font-weight');
	} else {
		fontName = fontFamily1;
		fontWeight = "normal";
	}

	if (!testDiv) {
		var payload = `
			<div id="Test"></div>
		`;
		var htmlContent = new DOMParser().parseFromString(payload, "text/html");
		testDiv = htmlContent.body.firstChild;
		document.body.appendChild(testDiv);
	}

	testDiv.innerHTML = str;

	testDiv.style.fontFamily = fontName;
	testDiv.style.fontWeight = fontWeight;
	testDiv.style.fontSize = fontSize + "px";
	var width = testDiv.clientWidth + 1;
	//var height = (testDiv.clientHeight + 1) + "px";
	//document.body.remove(testDiv);
	return width;
}

var refitCredits = function() {
	if (!table)
		return;
	for (var i in table.children) {
		var div = table.children[i];
		if (div.classList == undefined || !div.classList.contains("Row"))
			continue;

		var betMultiplier = "";
		var betMultEl = getElementFromDiv(div, "BetMultiplierVal");
		if (betMultEl != undefined) {
			betMultiplier = +betMultEl.innerHTML.slice(0, -1);
		}

		fitCreditsInDiv(div, betMultiplier);
	}
}

var shrinkToFit = function(div, percentW, text) {
	if (div == undefined)
		return;

	if (text == undefined)
		text = div.innerHTML;
	if (text.length < 2)
		return 0;

	var bkup = div.style.fontSize;
	div.style.fontSize = "";
	var computedStyle = window.getComputedStyle(div, null);
	var maxFont = computedStyle.getPropertyValue('font-size');
	maxFont = Math.ceil(parseFloat(maxFont));

	var availableW = computedStyle.getPropertyValue('width');
	if (availableW == "auto")
		return -1;
	availableW = Math.floor(parseFloat(availableW) * percentW);

	var smallerFont = fitText(text, availableW, 1, maxFont, div);
	if (smallerFont != maxFont)
		div.style.fontSize = smallerFont + "px";

	return 1;
}

var fitStatusText = function() {
	var textEl = document.getElementById("StatusText");
	if (textEl.innerHTML.length < 5)
		return;

	var statusEl = document.getElementById("Status");
	var percentW = 0.9;
	if (statusEl.classList.contains("StatusReady"))
		percentW = 0.8;
	else if (statusEl.classList.contains("StatusPaused"))
		percentW = 0.97;
	else if (statusEl.classList.contains("StatusPlaying"))
		percentW = 0.97;

	textEl.style.lineHeight = '';
	shrinkToFit(textEl, percentW);
	// if (textEl.style.fontSize != '') {
	// 	var str = textEl.style.fontSize;
	// 	var size = str.slice(0, -2);
	// 	textEl.style.lineHeight = (+size + 2) + 'px';
	// }
}

var fitCredits = function(spin, betMultiplier) {
	if (!spin || !spin.div)
		return;

	var shrinked = fitCreditsInDiv(spin.div, betMultiplier);
	if (shrinked)
		spin.shrinkFont = true;
}

var fitCreditsInDiv = function(div, betMultiplier) {
	if (!div)
		return false;
	var creditsValEl = getElementFromDiv(div, "CreditsValue");
	if (!creditsValEl || creditsValEl.innerHTML.length == 0)
		return false;

	var creditsEl = getElementFromDiv(div, "Credits");

	if (betMultiplier > 0)
		betMultiplier = (betMultiplier / 1).toFixed(2);

	var fits = true;
	var availableW;

	var testStr = creditsValEl.innerHTML;
	if (charMaxCount > (testStr + betMultiplier).length) {
		creditsEl.style.fontSize = "";
		creditsEl.classList.remove("smallerFont");

		var betMultEl = getElementFromDiv(div, "BetMultiplierVal");
		if (betMultEl != undefined) {
			betMultEl.classList.remove("smallerFont");
			betMultEl.style.top = "";
		}

		return false;
	}

	availableW = row_width * 0.3 + 0.5 * marginSize;

	var strW = getWidthFor(testStr, tableFontSize, div);
	if (strW > availableW) {
		fits = false;
		creditsEl.classList.add("smallerFont");
	}

	var betMultEl = getElementFromDiv(div, "BetMultiplierVal");
	if (betMultEl != undefined) {
		var multiplierStr = betMultiplier + "x";
		var multiplierFits = true;
		if (multiplierStr.length >= 4) {
			var multiplierW = getWidthFor(multiplierStr + " ", tableFontSize, betMultEl);

			availableW = row_width / 2 - marginSize;

			if (strW + multiplierW + charW > availableW && !fits)
				strW = getWidthFor(testStr, smallerFontSize, betMultEl);

			if (strW + multiplierW + charW > availableW) {
				if (fits) {
					creditsEl.classList.add("smallerFont");
					strW = getWidthFor(testStr, smallerFontSize, betMultEl);

					if (strW + multiplierW + charW > availableW)
						multiplierFits = false;
				} else
					multiplierFits = false;

				fits = false;
			}
		}

		if (multiplierFits) {
			betMultEl.classList.remove("smallerFont");
			betMultEl.style.top = "";
		} else {
			betMultEl.classList.add("smallerFont");
			if (betMultEl.className.indexOf("bigMultiplier") > -1)
				betMultEl.style.top = "0.7em";
		}
	}

	if (fits) {
		//&& creditsEl.style.width.length > 0) {
		//creditsEl.style.width = "30%";
		creditsEl.style.fontSize = "";
		creditsEl.classList.remove("smallerFont");
	}

	return !fits;
}

var toggleRow = function(spin, winType) {
	var row = spin.div;
	if (row == null)
		return;

	if (spin.betValue < 0) {
		var isBonus = getElementFromDiv(row, "fsBonus");
		if (isBonus != undefined) {
			if (row.className.indexOf("winFirstRow") >= 0) {
				row.className = "Row winRow expanded";
				var bgState = getElementFromDiv(row, "BGState");
				if (bgState != undefined)
					bgState.className = "BGState BGTumbleMid";

				var bigMultiplierEl = getElementFromDiv(row, "fsBonusVal");
				if (bigMultiplierEl != undefined)
					bigMultiplierEl.className = "fsBonusVal bigMultiplier bonusMultiplier";
			} else
				row.className = "Row loseRow expanded";
		}

		return;
	}

	row.classList.remove("winFirstRow");
	row.classList.remove("loseFirstRow");
	row.classList.remove("tumbleStartFirstRow");
	row.classList.remove("tumbleMidFirstRow");
	row.classList.remove("firstTumble");
	if (winType >= RESULT_TYPE.SMALL_WIN) {
		row.classList.add("winRow");
	} else {
		row.classList.remove("loseFirstRow");
		row.classList.add("loseRow");
	}

	var betMultiplierEl = getElementFromDiv(row, "BetMultiplierVal");
	var betMultiplier;
	if (spin.collapsedFS)
		betMultiplier = spin.collapsedWinFS / spin.baseBet;
	else if (spin.collapsed)
		betMultiplier = spin.collapsedWin / spin.baseBet;
	else
		betMultiplier = spin.betMultiplier;

	setWinMultiplierBg(spin, betMultiplier, winType >= RESULT_TYPE.SMALL_WIN);
	toggleBlack(spin, winType, false);
	fitCredits(spin, betMultiplier);

	var startIndex = -1;
	if (spin.freeSpinState == "LastFreeSpin")
		startIndex = spin.startFS;
	else if (spin.freeSpinState == "" && spin.tumblingState == "TumbleEnd")
		startIndex = spin.startTumble;
	if (startIndex > 0) {
		//on tumble end change bg for all kids 
		for (var i = spin.index - 1; i >= startIndex; i--) {
			var tumbleSpin = sessionData[i - 1];
			toggleRow(tumbleSpin, winType);
		}
	}
}

var getWinType = function(spin) {
	var win = spin.win;
	var winVal = spin.winVal;

	var collapsedWin;
	if (spin.collapsedWinFS != undefined)
		collapsedWin = spin.collapsedWinFS;
	else {
		collapsedWin = spin.collapsedWin;
		if (spin.tumbleMultiplier > 1)
			collapsedWin = collapsedWin * spin.tumbleMultiplier;
	}

	if (collapsedWin != undefined)
		winVal = collapsedWin;

	if (winVal > spin.baseBet)
		return RESULT_TYPE.WIN;
	else if (winVal > 0 || (spin.tumblingState == "TumbleEnd" && spin.collapsedWin > 0)) {
		return RESULT_TYPE.SMALL_WIN;
	} else
		return RESULT_TYPE.LOSE;
}

var toggleFirstRow = function(spin, force) {
	if (spin == undefined)
		return;

	if (HPVARS.fsbgMsgIndex < 0 && (spin.freeSpinState == "" || spin.freeSpinState == "LastFreeSpin") && (spin.tumblingState == "" || spin.tumblingState == "TumbleEnd"))
		removeLine(1);

	var row = spin.div;

	var rowContent = row.children[0];
	if (rowContent == undefined || spin.betValue < 0) {
		return;
	}
	var winType = getWinType(spin);
	if (currentFSSEssion != undefined && currentFSSEssion.collapsedWinFS > spin.baseBet)
		winType = RESULT_TYPE.WIN;
	var useGoldRow = (spin.tumblingState == "TumbleStart" || spin.tumblingState == "Tumble") || ((spin.freeSpinState == "FreeSpinsStart" || spin.freeSpinState == "FreeSpins"));

	if (winType >= RESULT_TYPE.WIN && useGoldRow) {
		row.className = "Row expanded";
		if (spin.tumblingState == "TumbleStart" || spin.freeSpinState == "FreeSpinsStart")
			row.classList.add("tumbleStartFirstRow");
		else if (spin.tumblingState == "Tumble" || spin.freeSpinState != "")
			row.classList.add("tumbleMidFirstRow");

		toggleBlack(spin, winType, true);
		return;
	}

	if (force || ((spin.freeSpinState == "" || spin.freeSpinState == "LastFreeSpin") && (spin.tumblingState == "" || spin.tumblingState == "TumbleEnd")))
		toggleRow(spin, winType);
	else {
		//row.className = "Row expanded";
		row.classList.add("firstTumble");
	}
}

var injectSpinRow = function(spin) {
	toggleFirstRow(lastSpin, false);
	createDivOfType(spin, "FirstRow");
	lastSpin = spin;
	updateSpinValue();
}

var collapseLastSession = function() {
	var collapseFSTimeout = 0;
	if (latestSessionToCollapse) {
		setOnCollapseCallback(latestSessionToCollapse, false);
		latestSessionToCollapse = undefined;
		collapseFSTimeout += 1000;
	}
}

var addLine = function(bgName) {
	var rowPayload = `
		<div class="${bgName}">
		</div>
	`;

	var htmlContent = new DOMParser().parseFromString(rowPayload, "text/html");
	var row = htmlContent.body.firstChild;
	if (table.children.length == 0)
		table.appendChild(row);
	else
		table.insertBefore(row, table.children[0]);
	return row;
}

var removeLine = function(index) {
	if (index != 0 && index != 1)
		return;

	var div = thinLines[index];
	if (div != null && table.contains(div)) {
		table.removeChild(div);
		thinLines[index] = null;
		div = null;
	}
}

var setLine = function(bgName, index) {
	var line = null;
	if (index == 0 || index == 1)
		line = thinLines[index];
	if (line != null && table.contains(line)) {
		line.className = bgName;
		return line;
	}

	var row = addLine(bgName);
	return row;
}

var IsAlreadyGolden = function(spin) {
	return (spin.div.className.indexOf("winFirstRow") >= 0 || spin.div.className.indexOf("tumbleStartFirstRow") >= 0 || spin.div.className.indexOf("tumbleMidFirstRow") >= 0);
}

var makeAllRowsInRoundGold = function(spin) {
	var startIndex = -1;
	if (spin.freeSpinState == "") {
		if (!currentSession)
			return;
		startIndex = currentSession.index;
	} else {
		if (!currentFSSEssion)
			return;

		startIndex = currentFSSEssion.index;
	}

	if (HPVARS.fsbgMsgIndex >= 0 && HPVARS.fsbgMsgIndex < startIndex)
		startIndex = HPVARS.fsbgMsgIndex;

	if (startIndex > 0 && spin.index > 1) {
		var i = spin.index - 1;
		if (IsAlreadyGolden(sessionData[startIndex - 1]) && IsAlreadyGolden(sessionData[i - 1]))
			return;

		for (; i >= startIndex; i--) {
			var tumbleSpin = sessionData[i - 1];
			var row = tumbleSpin.div;
			if (tumbleSpin.betValue < 0) {
				var isBonus = getElementFromDiv(row, "fsBonus");
				if (isBonus != undefined) {
					row.className = "Row winFirstRow expanded";
					var bgState = getElementFromDiv(row, "BGState");
					if (bgState != undefined)
						bgState.className = "BGState BGTumbleMidBlack";

					var bigMultiplierEl = getElementFromDiv(row, "fsBonusVal");
					if (bigMultiplierEl != undefined)
						bigMultiplierEl.className = "fsBonusVal bigMultiplierBlack bonusMultiplier";
				}

				continue;
			}
			row.className = "Row expanded";
			if (tumbleSpin.tumblingState == "TumbleStart" || tumbleSpin.freeSpinState == "FreeSpinsStart")
				row.classList.add("tumbleStartFirstRow");
			else if (tumbleSpin.tumblingState == "Tumble" || tumbleSpin.freeSpinState != "")
				row.classList.add("tumbleMidFirstRow");

			setWinMultiplierBg(tumbleSpin, tumbleSpin.betMultiplier, true);
			toggleBlack(tumbleSpin, RESULT_TYPE.WIN, true);
		}
	}
}

var createDivOfType = function(spin, rowType) {
	if (spin == undefined)
		return null;

	var win = spin.win;
	var winVal = 0;
	var winType = getWinType(spin);
	var isWin;

	var betMultiplier = spin.betMultiplier;
	var betMultiplierStr = spin.betMultiplier + "x";
	if (spin.maxWin)
		betMultiplierStr = hyperTexts.max[langIDX];

	var isFirstRow = rowType == "FirstRow";
	var rowClass, contentClass;
	if (isFirstRow) {
		if (currentFSSEssion != undefined && currentFSSEssion.collapsedWinFS > spin.baseBet)
			winType = RESULT_TYPE.WIN;
		isWin = winType >= RESULT_TYPE.WIN;

		rowClass = "Row"
		contentClass = "RowContent";
	} else {
		winVal = getWinVal(spin);
		betMultiplier = winVal / spin.betValue;
		win = LocaleManager.FormatValue(winVal, new FormatOptions());

		isWin = winVal > 0;
		if (spin.isCollapsed) {
			rowClass = "Row collapsed";
			contentClass = "RowContent contentCollapsed";
		} else {
			rowClass = "Row expanded";
			contentClass = "RowContent contentExpanded";
		}
	}

	if (isWin) {
		rowClass = rowClass + " win" + rowType;
	} else {
		rowClass = rowClass + " lose" + rowType;
	}

	var rowPayload = `
		<div class="${rowClass}">
			<div class="${contentClass}">
				<div class="Spin">
					<img class="BGState"/>
					<img class="SpinState"/>
					<div class="SpinIndex">${spin.roundIndex}</div>
				</div>
				
				<div class="Win">
					<div class="WinValue">${win}</div>
				</div>
				<div class="BetMultiplier">
					<div class="BetMultiplierVal">${betMultiplierStr}</div>
				</div>
				<div class="Credits">
					<div class="CreditsValue">${spin.balance}</div>
				</div>
			</div>
		</div>
	`;
	var htmlContent = new DOMParser().parseFromString(rowPayload, "text/html");
	var row = htmlContent.body.firstChild;

	spin.div = row;

	if (isFirstRow) {
		var bgName1 = isWin ? "goldLine2" : "whiteLine";

		if (isWin) {
			makeAllRowsInRoundGold(spin);
		}
		if (!firstLine) {
			if (HPVARS.fsbgMsgIndex < 0 && (spin.freeSpinState == "" || spin.freeSpinState == "FreeSpinsStart") && (spin.tumblingState == "" || spin.tumblingState == "TumbleStart")) {
				removeLine(1);
				thinLines[1] = setLine(bgName1, 0);
			} else {
				removeLine(0);
				if (thinLines[1] != null)
					setLine(bgName1, 1);
			}
		}

		if (table.children.length == 0)
			table.appendChild(row);
		else
			table.insertBefore(row, table.children[0]);
	}

	setSpinType(spin, isWin);
	setWinMultiplierBg(spin, betMultiplier, isWin && isFirstRow);
	fitCredits(spin, -1);

	if (!isFirstRow) {
		setWinValAndMultiplier(spin, 1, 1, 0, winVal);
		setTextColor(spin, winType, false);
		addReplayButton(spin, spin.replayWinning)

		var collapseFS = false;
		var collapseSpin = undefined;
		if (spin.tumbleSessionFS) {
			collapseSpin = spin.tumbleSessionFS;
			collapseFS = true;
		} else
			collapseSpin = spin.tumbleSession;

		if (collapseSpin != undefined) {
			row.addEventListener("click", function() {
				onCollapse(collapseSpin, collapseFS);
			}, false);
		}

		return row;
	}

	setExtraTextColor(spin, isWin);
	row.style.color = isWin ? "#000000" : "#FFFFFF";

	thinLines[0] = addLine(isWin ? "goldLine2" : "whiteLine");
	beforeTransitionH(row);

	var content = getElementFromDiv(row, "RowContent");
	content.classList.toggle("contentExpanded");
	row.classList.toggle("expanded");

	var isTumble = spin.tumblingState != "";
	if (winType >= RESULT_TYPE.WIN && isTumble) {
		if (playingGoldSnd == undefined) {
			playingGoldSnd = HyperplaySound("spin_gold_loop", true);
		}

		if (spin.tumblingState == "TumbleEnd") {
			HyperplaySound("spin_gold_final");
			stopGoldLoopSound();
		} else
			HyperplaySound("spin_gold");
	} else if (winType >= RESULT_TYPE.SMALL_WIN)
		HyperplaySound("spin_win");
	else
		HyperplaySound("spin");

	if (isWin && (spin.betMultiplier >= bigMultiplierLimits[0]) && spin.tumblingState == "")
		playWinAnimation(spin.betMultiplier);

	firstLine = false;
	startScrollRow(spin);
}

var startScrollRow = function(spin) {
	if (playingFeatureInGame) {
		setTimeout(function() {
			setReady(CHECK.EXPAND);
		}, expandTime * 200);
		return;
	}

	scrollH = row_height;

	if (table.children[0].className.indexOf("Line") > 0)
		scrollH += line_height;

	lastScrollTime = currentTime;
	table.scrollTo({
		left: 0,
		top: scrollH,
		behavior: "instant"
	});

	scrollTime = maxScrollTime;
	if (spin.betValue <= 0)
		expandTimeout = 100;
	else if (spin.tumblingState != "" && spin.freeSpinState != "")
		expandTimeout = 0;
	else
		expandTimeout = 70;
}

var removeWithDelay = function(div, timeout) {
	var betMultiplierEl = getElementFromDiv(div, "BetMultiplier");
	if (betMultiplierEl) {
		setTimeout(function() {
			betMultiplierEl.classList.add("invisible");
		}, multiplierCollapse * 1000);
	}

	setTimeout(function() {
		if (table == undefined)
			return;
		if (!table.contains(div) || div == firstRow)
			return;
		table.removeChild(div);
	}, timeout);
}

var toggleRowType = function(spin, winType, isBlack) {
	var div = spin.div;
	if (spin.fsEND != undefined)
		div = spin.fsEND.div;

	var isFirstRow = div.className.indexOf("FirstRow") > -1;
	var rowType = isFirstRow ? "FirstRow" : "Row";

	var collapsedWin = (spin.collapsedFS != undefined) ? spin.collapsedWinFS : spin.collapsedWin;
	if (spin.tumbleMultiplier > 1)
		collapsedWin = collapsedWin * spin.tumbleMultiplier;
	if (isFirstRow && spin.collapsedWinFS != undefined)
		collapsedWin = spin.collapsedWinFS;
	var isWin = isFirstRow ? collapsedWin > spin.baseBet : collapsedWin > 0;
	var addType = isWin ? "win" : "lose";
	div.classList.remove("win" + rowType);
	div.classList.remove("lose" + rowType);
	div.classList.add(addType + rowType);

	setTextColor(spin, winType, isBlack);
}

var collapseDiv = function(row, timeout) {
	setTimeout(function() {
		row.isCollapsed = true;
		var rowContent = row.div.children[0];

		if (row.betValue >= 0) {
			row.div.style.transition = rowTransition;
			if (rowContent != undefined)
				rowContent.className = "RowContentCollapsed";
		}

		row.div.classList.remove("expanded");
		beforeTransitionH(row.div);
		row.div.classList.add("collapsed");

		if (row.betValue >= 0 && rowContent != undefined) {
			beforeTransitionH(rowContent);
			rowContent.classList.add("contentCollapsed");
		}
	}, timeout);
}

var currentFSSEssion = undefined;
var tumbleWithFS = undefined;
var inFS = false;
var lastRoundWin = 0;

var changeTimeout = 30;

var getWinVal = function(spin) {
	var winVal = spin.winVal;
	if (spin.collapsed) {
		if (spin.freeSpinState == "LastFreeSpin") {
			if (spin.collapsedFS)
				winVal = spin.collapsedWinFS;
			else
				winVal = spin.collapsedWin;
		} else if (spin.tumblingState == "TumbleEnd")
			winVal = spin.collapsedWin;
	}

	return winVal;
}

var setWinValAndMultiplier = function(spin, step, stepsCount, startVal, endVal) {
	var row = spin.div.children[0];
	if (row == undefined)
		return;
	var betEl = getElementFromDiv(row, "BetMultiplierVal");
	var isFirstRow = spin.div.className.indexOf("FirstRow") > -1;
	var tumbleMultiplier = (endVal / spin.baseBet).toFixed(2);

	// if (step >= stepsCount)
	// 	tumbleMultiplier = tumbleMultiplier.replace(/[.,]00$/, "");

	if (tumbleMultiplier < bigMultiplierLimits[0]) {
		betEl.classList.remove("bigMultiplierBlack");
		betEl.classList.remove("bigMultiplier");
	} else {
		if (isFirstRow) {
			betEl.classList.remove("bigMultiplier");
			betEl.classList.add("bigMultiplierBlack");
		} else {
			betEl.classList.remove("bigMultiplierBlack");
			betEl.classList.add("bigMultiplier");
		}
	}

	setWinVal(spin, step, stepsCount, startVal, endVal);

}

var setWinVal = function(spin, step, stepsCount, startVal, endVal) {
	var winVal;
	if (step >= stepsCount)
		winVal = endVal;
	else {
		winVal = startVal + (endVal - startVal) * step / stepsCount;
	}

	var row = spin.div.children[0];
	if (row == undefined)
		return;
	var winEl = getElementFromDiv(row, "WinValue");
	winEl.innerHTML = LocaleManager.FormatValue(winVal, new FormatOptions());
	var betEl = getElementFromDiv(row, "BetMultiplierVal");
	var tumbleMultiplier = (winVal / spin.baseBet).toFixed(2);
	if (step >= stepsCount)
		tumbleMultiplier = tumbleMultiplier.replace(/[.,]00$/, "");

	betEl.innerHTML = tumbleMultiplier + "x";

	if (step < stepsCount)
		setTimeout(function() {
			setWinVal(spin, step + 1, stepsCount, startVal, endVal);
		}, changeTimeout);
}

var collapseWin = function(spin, timeout, startVal, endVal) {
	var stepsCount = Math.round(timeout / changeTimeout);

	setTimeout(function() {
		setWinValAndMultiplier(spin, 1, stepsCount, startVal, endVal);
	}, changeTimeout);
}

var applyWinMultiplier = function(spin, collapseFS) {
	var multiplierTimeout = 0;
	var el = undefined;
	var hasMultiplier = false;
	if (spin.tumbleMultiplier != undefined && spin.tumbleMultiplier != 1 && spin.tumbleMultiplier > 0) {
		hasMultiplier = true;
		multiplierTimeout = (multiplierTime0 + multiplierTime1 + multiplierTime2) * 1000;
		var winMultiplier = spin.tumbleMultiplier + "x";
		var row = spin.div.children[0];
		if (row == undefined)
			return;
		el = getElementFromDiv(row, "WinMultiplier");
		if (el == undefined) {
			var iDiv = document.createElement('div');
			iDiv.className = 'WinMultiplier';
			iDiv.innerHTML = winMultiplier;
			if (isGoldRow(spin))
				iDiv.style.color = "#000000";

			var winEl = getElementFromDiv(row, "Win");
			winEl.insertBefore(iDiv, winEl.children[0]);
			el = iDiv;
		} else
			el.innerHTML = winMultiplier;

		var currentWin = spin.collapsedWin;
		var targetWin = currentWin * spin.tumbleMultiplier;
		if (spin.freeSpinState == "")
			lastRoundWin = targetWin;

		var mustPlayAnimation = false;
		var isBlack = spin.div.className.indexOf("FirstRow") > -1;
		if (isBlack && (spin.betMultiplier < bigMultiplierLimits[0])) {
			var targetMultiplier = targetWin / spin.baseBet;
			if (targetMultiplier >= bigMultiplierLimits[0])
				mustPlayAnimation = true;
		}

		HyperplaySound("multiplier");
		beforeTransitionH(el);
		el.classList.toggle("FadeRight1");

		setTimeout(function() {
			beforeTransitionH(el);
			el.classList.toggle("FadeRight2");

			setTimeout(function() {
				beforeTransitionH(el);
				el.classList.toggle("FadeRight3");
				HyperplaySound("coin_counter_multi");

				collapseWin(spin, multiplierTime2 * 1000, currentWin, targetWin);

				setTimeout(function() {
					if (mustPlayAnimation)
						playWinAnimation(targetMultiplier);
				}, multiplierTime2 * 500);

			}, multiplierTime1 * 1000 + 50);
		}, multiplierTime0 * 1000);
	}

	setTimeout(function() {
		if (el != undefined) {
			el.innerHTML = "";
			//or remove div?
			if (sessionData.length < spin.index)
				return;
			for (var i = spin.startTumble; i <= spin.index; i++) {
				var child = sessionData[i - 1];
				var winVal = child.winVal;
				var newWin = winVal * spin.tumbleMultiplier;
				if (child.collapsedWin)
					child.collapsedWin = child.collapsedWin * spin.tumbleMultiplier;
				child.win = LocaleManager.FormatValue(newWin, new FormatOptions());
				child.betMultiplier = (newWin / child.baseBet).toFixed(2).replace(/[.,]00$/, "");

				if (child.tumbleMultiplier != undefined)
					child.tumbleMultiplier = -child.tumbleMultiplier;
			}
		}

		onFirstCollapseDone(spin, collapseFS, false);
	}, multiplierTimeout + 100);

	return hasMultiplier;
}

var setWinMultiplierBg = function(spin, multiplierValue, isBlack) {
	var row = spin.div.children[0];
	if (row == undefined)
		return;
	var betMultiplierEl = getElementFromDiv(row, "BetMultiplierVal");
	if (betMultiplierEl == undefined)
		return;
	if (+multiplierValue >= bigMultiplierLimits[0] || spin.maxWin) {
		betMultiplierEl.style.fontWeight = "bold";
		if (isBlack) {
			betMultiplierEl.classList.remove("bigMultiplier");
			betMultiplierEl.classList.add("bigMultiplierBlack");
		} else {
			betMultiplierEl.classList.add("bigMultiplier");
			betMultiplierEl.classList.remove("bigMultiplierBlack");
		}
	} else {
		if (spin.div.className.indexOf("FirstRow") < 0)
			betMultiplierEl.style.fontWeight = "normal";
		else
			betMultiplierEl.style.fontWeight = "bold";
		betMultiplierEl.classList.remove("bigMultiplier");
		betMultiplierEl.classList.remove("bigMultiplierBlack");
	}
}

var setSpinType = function(spin, isBlack) {
	var spinEl = getElementFromDiv(spin.div, "Spin");
	var bgstate = getElementFromDiv(spinEl, "BGState");
	var spinState = getElementFromDiv(spinEl, "SpinState");
	var spinIndexEl = getElementFromDiv(spin.div, "SpinIndex");

	var spinStateClass = undefined;
	var bgStateClass = undefined;

	if (spin.freeSpinState == "" || spin.collapsedFS)
		spinIndexEl.innerHTML = "";
	else {
		spinIndexEl.innerHTML = spin.roundIndex;
	}

	if (spin.tumblingState == "TumbleEnd") {

		if (spin.freeSpinState == "FreeSpinsStart") {
			spinStateClass = "IsWinFreeSpin";
			bgStateClass = spin.collapsed ? "BGTumbleSingle" : "BGTumbleTop";
		} else if (spin.collapsedFS) {
			spinStateClass = "IsWinFreeSpin";
			bgStateClass = "BGTumbleSingle";
		} else if (spin.collapsed) {
			if (spin.freeSpinState == "LastFreeSpin")
				bgStateClass = "BGFreeSpinTumbleSingleEnd";
			else
				bgStateClass = spin.freeSpinState == "FreeSpins" ? "BGFreeSpinTumbleSingle" : "BGTumbleSingle";

			spinStateClass = ((spin.freeSpinState == "FreeSpins" || spin.freeSpinState == "LastFreeSpin")) ? "IsFreeSpin" : "IsSimpleWin";
			if (spin.collapsedWin <= 0)
				spinStateClass = "IsSimpleLose";
		} else {
			spinStateClass = isBlack ? "IsSimpleWin" : "IsSimpleLose";
			bgStateClass = (spin.freeSpinState == "FreeSpins" || spin.freeSpinState == "LastFreeSpin") ? "BGFreeSpinTumbleTop" : "BGTumbleTop";
		}
	} else if (spin.tumblingState == "TumbleStart") {
		spinStateClass = (spin.freeSpinState == "FreeSpins") ? "IsFreeSpin" : "IsSimpleWin";
		if (spin.winVal <= 0 && spin.collapsedWinFS <= 0)
			spinStateClass = "IsSimpleLose";
		bgStateClass = (spin.freeSpinState == "FreeSpins") ? "BGFreeSpinTumbleBot" : "BGTumbleBot";
	} else if (spin.tumblingState == "Tumble") {
		spinStateClass = "IsTumble";
		bgStateClass = (spin.freeSpinState == "FreeSpins") ? "BGFreeSpinMid" : "BGTumbleMid";
	} else {
		if (spin.freeSpinState == "FreeSpinsStart") {
			spinStateClass = "IsWinFreeSpin";
			bgStateClass = "BGTumbleSingle";
		} else if (spin.freeSpinState == "FreeSpins" || spin.freeSpinState == "LastFreeSpin")
			spinStateClass = "IsFreeSpin";
		else {
			var winType = getWinType(spin);
			spinStateClass = winType == RESULT_TYPE.LOSE ? "IsSimpleLose" : "IsSimpleWin";
		}

		if (spin.freeSpinState == "FreeSpins")
			bgStateClass = "BGFreeSpinTumbleSingle";
		else if (spin.freeSpinState == "LastFreeSpin")
			bgStateClass = spin.collapsedFS ? "BGTumbleSingle" : "BGFreeSpinTumbleSingleEnd";
		// else
		// 	bgStateClass = "BGTumbleSingle"; //undefined
	}

	var extraName = "";
	if (isBlack && spin.div.className.indexOf("FirstRow") > -1)
		extraName = "Black";

	bgstate.className = "BGState";
	spinState.className = "SpinState";

	if (spinStateClass != undefined)
		spinState.classList.toggle(spinStateClass + extraName);

	if (bgStateClass != undefined)
		bgstate.classList.toggle(bgStateClass + extraName);

	if (bgstate.classList.length == 1)
		bgstate.style.display = "none";

	if (spin.collapsedFS) {
		showAdditionalFS(spin, spin.maxSpins);
	} else if (spin.additionalSpins != undefined && spin.additionalSpins > 0) {
		showAdditionalFS(spin, spin.additionalSpins);
	} else {
		showAdditionalFS(spin, 0);
	}
}

var onFirstCollapseDone = function(spin, collapseFS, force) {
	var startTumble = collapseFS ? spin.startFS : spin.startTumble;

	if (collapseFS) {
		HyperplaySound("fs_gz");
	}

	for (i = startTumble; i <= spin.index; i++) {
		if (sessionData.length < i)
			break;
		var child = sessionData[i - 1];
		if (collapseFS && (child.tumblingState != "" && child.freeSpinState != "LastFreeSpin")) {
			child.fsSession = spin;
			continue;
		}

		if (collapseFS)
			child.tumbleSessionFS = spin;
		else
			child.tumbleSession = spin;
		child.div.addEventListener("click", function() {
			onCollapse(spin, collapseFS);
		}, false);
	}

	if (!force)
		setTimeout(function() {
			setReady(CHECK.COLLAPSE);
		}, 400);
}

var lastCredit = -1;
var lastPromoWin = 0;
var setLastCredit = function(balance) {
	lastCredit = balance + lastPromoWin;
	lastPromoWin = 0;
}

var getElementFromDiv = function(div, className) {
	var el = div.querySelector("." + className);
	return el;
}

var onCollapse = function(tumbleSession, collapseFS) {
	if (HPVARS.fsbgMsgIndex >= 0) {
		setReady(CHECK.COLLAPSE);
		return;
	}
	if (!collapseFS && tumbleSession.collapsed && (tumbleSession.freeSpinState != "")) {
		if (tumbleSession.fsSession != undefined)
			return onCollapse(tumbleSession.fsSession, true);
		collapseFS = true;
	} else if (tumbleSession.freeSpinState == "FreeSpins" && !tumbleSession.collapsed) {
		collapseFS = false;
	}

	var startTumble = collapseFS ? tumbleSession.startFS : tumbleSession.startTumble;
	if (startTumble == undefined)
		return;

	if (tumbleSession.busy)
		return;

	var tumbleDiv = tumbleSession.div;
	var isFirstRow = tumbleDiv.className.indexOf("FirstRow") > -1;

	var collapsed = collapseFS ? tumbleSession.collapsedFS : tumbleSession.collapsed;
	var mustCollapse = !collapsed;
	var collapsedWin = collapseFS ? tumbleSession.collapsedWinFS : tumbleSession.collapsedWin;

	var winType = RESULT_TYPE.LOSE;

	var finalWin = collapsedWin;

	if (collapseFS) {
		tumbleSession.collapsedFS = !tumbleSession.collapsedFS;
		tumbleSession.collapsed = tumbleSession.collapsedFS;

		if (isFirstRow) {
			for (i = tumbleSession.startFS; i <= tumbleSession.index; i++) {
				if (sessionData.length < i)
					break;
				var child = sessionData[i - 1];
				if (child.freeSpinState == "FreeSpinsStart") {
					child.roundEnd = tumbleSession.index;
					break;
				}
			}
		}
	} else {
		if (tumbleSession.tumbleMultiplier > 1)
			finalWin = collapsedWin * tumbleSession.tumbleMultiplier;

		if (isFirstRow && tumbleSession.collapsedWinFS != undefined)
			finalWin = tumbleSession.collapsedWinFS;

		tumbleSession.collapsed = !tumbleSession.collapsed;
	}

	if (finalWin > tumbleSession.baseBet)
		winType = RESULT_TYPE.WIN;
	else if (finalWin > 0)
		winType = RESULT_TYPE.SMALL_WIN;
	else
		winType = RESULT_TYPE.LOSE;

	tumbleSession.busy = true;
	// || (tumbleDiv.className.indexOf("firstTumble") > -1);
	var rowType = isFirstRow ? "FirstRow" : "Row";
	// if (tumbleSession.fsEND != undefined)
	// 	tumbleDiv = tumbleSession.fsEND.div;
	var lastDiv = tumbleSession.div;
	var timeout = 0;
	var prevDivToRemove;
	var hasFSInCollapse = tumbleSession.freeSpinState == "FreeSpinsStart";
	var balanceAfterFS = undefined;
	var extraFS = 0;

	var nextDiv = undefined;
	if (startTumble > 1)
		nextDiv = sessionData[startTumble - 2].div;
	else if (startLines.length > 0)
		nextDiv = startLines[0];

	var startSpin = sessionData[startTumble - 1];
	var tumbleSize = tumbleSession.index - startTumble + 1;
	var collapseTimeout;
	for (var i = tumbleSession.index - 1; i >= startTumble; i--) {
		var row = sessionData[i - 1];

		if (mustCollapse) {
			if (!table.contains(row.div))
				continue;

			var rate = (tumbleSize - i) / tumbleSize;
			collapseDiv(row, timeout);
			if (row.betValue > 0)
				removeWithDelay(row.div, timeout + collapseTime * 1000);
			else
				removeWithDelay(row.div, timeout);
			collapseTimeout = timeout;
			//timeout += 50;
		} else {
			if (row.div == null)
				row.div = createDivOfType(row, "Row");
			row.collapsed = false;
			row.isCollapsed = false;

			if (nextDiv != undefined) {
				table.insertBefore(row.div, nextDiv);
				lastDiv = row.div;
			} else
				table.appendChild(row.div);

			var rowContent = row.div.children[0];
			if (rowContent != undefined) {
				rowContent.className = "RowContent";
				beforeTransitionH(row.div);
				rowContent.classList.add("contentExpanded");

				if (row.betValue >= 0) {
					getElementFromDiv(row.div, "WinValue").innerHTML = row.win;
					var betMultiplierEl = getElementFromDiv(row.div, "BetMultiplier");
					betMultiplierEl.classList.remove("invisible");
					getElementFromDiv(row.div, "BetMultiplierVal").innerHTML = row.betMultiplier + "x";
					getElementFromDiv(row.div, "Credits").children[0].innerHTML = row.balance;

					var isChildBlack = row.div.className.indexOf("FirstRow") > -1;
					setSpinType(row, isChildBlack);
					setExtraTextColor(row, isChildBlack)
					setWinMultiplierBg(row, row.betMultiplier, isChildBlack);

					row.div.style.transition = rowTransition;
					beforeTransitionH(row.div);
				}
			}

			row.div.classList.remove("collapsed");
			if (rowContent != undefined)
				row.div.classList.add("expanded");

		}

		if (row.freeSpinState == "FreeSpinsStart") {
			if (row.tumblingState == "TumbleEnd") {
				hasFSInCollapse = true;
			}

			balanceAfterFS = row.balanceAtTheEnd;
		}
	}

	var creditsAtEndofTumble;
	var tumbleWin, tumbleMultiplier;

	var extendedState;
	var collapsedState;

	var isWin = false;
	var extraName = "";
	var isBlack = false;
	if (isFirstRow) {
		if (winType >= RESULT_TYPE.WIN) {
			isBlack = true;
			extraName = "Black";
		}
	}

	if (isBlack && thinLines[1]) {
		thinLines[1].className = "goldLine2";
		HyperplaySound("collapse_spins_gold");
	} else
		HyperplaySound("collapse_spins");

	var currentWin;
	var targetWin;

	var replay = getElementFromDiv(tumbleSession.div, "Replay");

	if (collapsed) {
		if (replay)
			replay.classList.add("invisible");
		currentWin = collapsedWin;
		targetWin = tumbleSession.winVal;
		tumbleWin = tumbleSession.win;
		tumbleMultiplier = tumbleSession.betMultiplier;
		toggleRowType(tumbleSession, winType, isBlack);

		setTimeout(function() {
			var isFirstRow = tumbleDiv.className.indexOf("FirstRow") > -1;
			var tumbleIsBlack = isFirstRow && winType >= RESULT_TYPE.WIN;

			setSpinType(tumbleSession, tumbleIsBlack);
			setWinMultiplierBg(tumbleSession, tumbleMultiplier, tumbleIsBlack);
			fitCredits(tumbleSession, tumbleMultiplier);

		}, 10);

		collapseTimeout = expandTime * 1000;
		setTimeout(function() {
			tumbleSession.busy = false;
		}, 100 + collapseTimeout);

		creditsAtEndofTumble = tumbleSession.balance;
		extraFS = tumbleSession.additionalSpins;
	} else {
		if (replay)
			replay.classList.remove("invisible");

		currentWin = 0;
		targetWin = collapsedWin;
		tumbleMultiplier = (targetWin / tumbleSession.baseBet).toFixed(2);
		//.replace(/[.,]00$/, "");

		collapseTimeout = collapseTimeout + collapseTime * 1000;
		setWinMultiplierBg(tumbleSession, tumbleMultiplier, isBlack);

		fitCredits(tumbleSession, tumbleMultiplier);

		setTimeout(function() {
			var isFirstRow = tumbleDiv.className.indexOf("FirstRow") > -1;
			var tumbleIsBlack = isFirstRow && winType >= RESULT_TYPE.WIN;
			setSpinType(tumbleSession, tumbleIsBlack);
			toggleRowType(tumbleSession, winType, tumbleIsBlack);
		}, timeout + collapseTime * 500);

		setTimeout(function() {
			tumbleSession.busy = false;
			if (isFirstRow) {
				var hadMultiplier = applyWinMultiplier(tumbleSession, collapseFS);
				if (!hadMultiplier) {
					if (isBlack && (tumbleMultiplier >= bigMultiplierLimits[0]))
						playWinAnimation(tumbleMultiplier);
				}
			}
		}, timeout + collapseTime * 1000);

		creditsAtEndofTumble = tumbleSession.balance;
		if (creditsAtEndofTumble == "" && hasFSInCollapse) {
			if (tumbleSession.balanceAtTheEnd)
				creditsAtEndofTumble = tumbleSession.balanceAtTheEnd;
			else if (balanceAfterFS != undefined)
				creditsAtEndofTumble = balanceAfterFS;
		}

		if (collapseFS)
			extraFS = tumbleSession.maxSpins;
		else
			extraFS = tumbleSession.addAdditionalSpins;
	}

	var extraFSEl = getElementFromDiv(tumbleDiv, "FreeSpins");
	if (extraFS > 0) {
		showAdditionalFS(tumbleSession, extraFS);
	}

	if (!collapsed & isFirstRow)
		HyperplaySound("coin_counter_normal");

	if (tumbleSession.maxWin) {
		var betEl = getElementFromDiv(tumbleSession.div, "BetMultiplierVal");
		betEl.innerHTML = tumbleSession.betMultiplier;

		var winEl = getElementFromDiv(tumbleSession.div, "WinValue");
		if (collapsed)
			winEl.innerHTML = "";
		else if (collapseFS || tumbleSession.freeSpinState == "")
			winEl.innerHTML = LocaleManager.FormatValue(tumbleSession.collapsedWinFS, new FormatOptions());
		else
			winEl.innerHTML = LocaleManager.FormatValue(tumbleSession.collapsedWin * (-tumbleSession.tumbleMultiplier), new FormatOptions());

		if (isBlack)
			playWinAnimation(tumbleSession.collapsedWinFS / tumbleSession.baseBet);
	} else if (!collapsed) {
		collapseWin(tumbleSession, collapseTimeout, currentWin, targetWin);
	} else
		setWinValAndMultiplier(tumbleSession, 1, 1, currentWin, targetWin);

	var creditEl = getElementFromDiv(tumbleDiv, "Credits");
	creditEl.children[0].innerHTML = creditsAtEndofTumble;

	var currentBalance = currentSpin.balanceNo;
	if (!collapsed && isFirstRow && creditsAtEndofTumble.length > 0) {
		if (lastCredit > -1) {
			if (tumbleSession.tumbleMultiplier && tumbleSession.tumbleMultiplier != 1)
				if (tumbleSession.tumbleMultiplier > 0)
					targetWin = targetWin * tumbleSession.tumbleMultiplier;

			if ((tumbleSession.freeSpinState != 'LastFreeSpin' || collapseFS) && Math.round(currentBalance * 100) / 100 != Math.round((lastCredit + targetWin - tumbleSession.betValue) * 100) / 100)
				logCreditError();
		}

		if (tumbleSession.freeSpinState == "" || collapseFS)
			lastCredit = currentBalance;
	}
};

var setOnCollapseCallback = function(row, isFS) {
	if (row == undefined)
		return;

	row.div.style.transition = rowTransition;
	if (row.collapsed && !isFS)
		return;
	onCollapse(row, isFS);
}

var setCallbackAtTheEndOfFS = function() {
	if (!currentFSSEssion)
		return;

	ready[CHECK.COLLAPSE] = false;
	inFS = false;

	currentSpin.startFS = currentFSSEssion.index;
	if (currentFSSEssion.startTumble)
		currentSpin.startFS = currentFSSEssion.startTumble;

	currentSpin.betValue = sessionData[currentSpin.startFS - 1].betValue;
	if (HPVARS.fsbgMsgIndex > 0 && HPVARS.fsbgMsgIndex < currentSpin.startFS)
		currentSpin.startFS = HPVARS.fsbgMsgIndex;

	HPVARS.fsbgMsgIndex = -1;

	fsSessionToCollapse = currentSpin;
	fsSessionToCollapse.maxSpins = currentFSSEssion.maxSpins;
	if (!fsSessionToCollapse.maxWin)
		fsSessionToCollapse.collapsedWinFS = currentFSSEssion.collapsedWinFS;
	currentFSSEssion.balanceAtTheEnd = currentSpin.balance;
	currentFSSEssion = undefined;
}

var isGoldRow = function(spin) {
	return spin.div.className.indexOf("FirstRow") > -1 && spin.div.className.indexOf("loseFirstRow") < 0
}

var showAdditionalFS = function(fsSpin, additionalSpins) {
	var spin = getElementFromDiv(fsSpin.div, "Spin");
	var fsEl = getElementFromDiv(spin, "FreeSpins");
	if (additionalSpins <= 0) {
		if (fsEl != undefined)
			fsEl.innerHTML = "";
		return;
	}

	if (fsEl == undefined) {
		var iDiv = document.createElement('div');
		iDiv.className = 'FreeSpins';
		iDiv.innerHTML = "+" + additionalSpins;
		if (isGoldRow(fsSpin))
			iDiv.style.color = "#000000";

		spin.appendChild(iDiv);
	} else
		fsEl.innerHTML = "+" + additionalSpins;
}

var addAdditionalSpins = function(response) {
	if (response.IsFreeSpin) {
		var extraSpins = 0;
		if (response.AdditionalSpins > 0)
			extraSpins = response.AdditionalSpins;
		else if (currentFSSEssion) {
			if (currentFSSEssion.maxSpins == undefined)
				currentFSSEssion.maxSpins = 0;
			if (response.maxSpins > currentFSSEssion.maxSpins)
				extraSpins = response.maxSpins - currentFSSEssion.maxSpins;
		}

		if (extraSpins > 0) {
			if (currentFSSEssion)
				currentFSSEssion.maxSpins += extraSpins;

			currentSpin.additionalSpins = extraSpins;
			if (currentSession != null)
				currentSession.maxSpins = extraSpins;
		}
	}
}

var roundIndex = 1;

var addTumbleWinToFS = function() {
	if (currentFSSEssion == undefined)
		return;

	if (currentFSSEssion.collapsedWinFS == undefined)
		currentFSSEssion.collapsedWinFS = 0;

	var multiplier = 1;
	if (currentSpin.tumbleMultiplier != undefined)
		multiplier = currentSpin.tumbleMultiplier;

	currentFSSEssion.collapsedWinFS += currentSpin.collapsedWin * Math.abs(multiplier);
	currentSpin.collapsedWinFS = currentFSSEssion.collapsedWinFS;
}

var onFreeSpinsStart = function() {
	XT.SetBool(Vars.Autoplay_SkipScreens, false);
	XT.SetBool(Vars.AutoplayContinuousSpin, false);
	if (!HPVARS.playingFeature)
		playingFeatureInGame = true;
	spinTimer = 0;
	XT.SetBool(Vars.CanAnimateValues, true);
	mustHandleFSStart = true;
	if (responseQueue.length == 0)
		handleFSStartInHP();
}

var handleFSStartInHP = function() {
	if (!mustHandleFSStart)
		return;

	mustHandleFSStart = false;
	if (stopOnFeature)
		doStopOnFeature();
	else {
		HyperplaySound("bonus_round_trigg");
		globalTracking.SendEvent("uht_hyperplay", "FeaturePlayed_InGame", 0, "BehaviourTracker");
	}
}

var processBonusGameEnded = function(response) {
	if (sessionData.length == 0)
		return;

	var spin = sessionData[sessionData.length - 1];
	spin.maxSpins = response.maxSpins;
	spin.additionalSpins = response.maxSpins;
	inFS = true;

	if (lastRoundEnded[PROCESSED]) {
		totalSpinsCount[PROCESSED]++;
		currentSpinsCount[PROCESSED]++;
		//console.log("HYPERPLAY: newRound " + currentSpinsCount[PROCESSED]);
		if (isSessionDone())
			mustPause = true;

		lastRoundEnded[PROCESSED] = false;

	}

	showAdditionalFS(spin, spin.additionalSpins);
}

var processResponse = function(response) {

	if (response.roundID != undefined)
		updateFooter(response.roundID);

	if (response.data.name == "PROMO") {
		addPromoWin(response.data.promoType, response.data.WD, response.win);
		return;
	}

	if (response.data.name == "FSBG") {
		handleFSBGMessage(response.data);
		return;
	}

	// if (response.bonusGameEnded) {
	// 	processBonusGameEnded(response);
	// 	return;
	// }

	canProcessResponse = false;
	ready[CHECK.EXPAND] = false;

	if (response.data.name == "gameRoundEnded") {
		processRoundEnd(response);
		return;
	}

	var isBonusGame = response["bonusGame"] == true;
	var isFreeSpinStart = response.IsFreeSpinsStart || (isBonusGame && response.maxSpins > 0);
	if (isFreeSpinStart || !response.IsFreeSpin)
		roundIndex = 0;
	else if (currentFSSEssion == null)
		roundIndex = 1;

	if (!isFreeSpinStart && response.IsFreeSpin && currentFSSEssion == null)
		isFreeSpinStart = true;

	if (isFreeSpinStart) {
		handleFSStartInHP();
	}

	ready[CHECK.COLLAPSE] = false;
	ready[CHECK.ROUNDEND] = false;

	var tumble = response.tumble;
	var winReceived = response.win;

	//console.log("HYPERPLAY: process response " + spinIndex + " with win " + response.win);
	if (lastRoundEnded[PROCESSED]) {
		totalSpinsCount[PROCESSED]++;
		currentSpinsCount[PROCESSED]++;
		//console.log("HYPERPLAY: newRound " + currentSpinsCount[PROCESSED]);
		if (isSessionDone())
			mustPause = true;

		lastRoundEnded[PROCESSED] = false;

		if (!isBonusGame) {
			totalBet += response.data.betAmount;
			totalBetValue.innerHTML = LocaleManager.FormatValue(totalBet, new FormatOptions());
		}
	}

	var duringTumble = oldTumbleState != tumble;
	var lastTumble = duringTumble && oldTumbleState;
	var win = (tumble || lastTumble || response.IsFreeSpin) ? winReceived : response.data.winAmount;
	var betValue = response.data.betAmount;
	var baseBet = response.baseBet;
	var betMultiplier = (win / baseBet).toFixed(2).replace(/[.,]00$/, "");
	var balance = response.balance;

	var winStr = LocaleManager.FormatValue(win, new FormatOptions());
	var balanceStr = LocaleManager.FormatValue(balance, new FormatOptions());

	var roundIndexStr = roundIndex;
	if (roundIndex == 0)
		roundIndexStr = "";

	if (currentFSSEssion != undefined && response.IsFreeSpin && response.rid != currentFSSEssion.rid) {
		currentFSSEssion.rid = response.rid;
	}

	if (currentSession != null) {
		if (betValue <= 0)
			betValue = currentSession.betValue;
		else if (currentSession.betValue == undefined || currentSession.betValue <= 0)
			currentSession.betValue = betValue;
	}

	if (tumble) {
		setReady(CHECK.COLLAPSE);
		if (currentSession != null || response.IsFreeSpin)
			balanceStr = "";

		currentSpin = new Spin(spinIndex,winStr,win,betValue,baseBet,betMultiplier,balanceStr,"","",(currentSession == null) ? "TumbleStart" : "Tumble",response.IsFreeSpin ? "FreeSpins" : "");
		currentSpin.roundIndex = roundIndexStr;
		sessionData.push(currentSpin);
		if (currentSession == null) {
			currentSession = currentSpin;
			currentSession.collapsedWin = win;
		} else {
			if (lastSpin != undefined)
				currentSpin.collapsedWin = lastSpin.collapsedWin + win;
			else
				currentSpin.collapsedWin = win;

			currentSpin.startTumble = currentSession.index;
		}

		injectSpinRow(currentSpin);

	} else if (lastTumble) {
		if (response.IsFreeSpin && !response.IsLastFreeSpin)
			balanceStr = "";

		if (!isFreeSpinStart)
			winStr = LocaleManager.FormatValue(0, new FormatOptions());
		currentSpin = new Spin(spinIndex,winStr,0,betValue,baseBet,0,balanceStr,"","","TumbleEnd",(response.IsFreeSpin ? (isFreeSpinStart ? "FreeSpinsStart" : (response.IsLastFreeSpin ? "LastFreeSpin" : "FreeSpins")) : ""));
		currentSpin.roundIndex = roundIndexStr;
		if (!currentSession)
			currentSession = currentSpin;

		if (!currentSpin.collapsedWin) {
			if (lastSpin)
				currentSpin.collapsedWin = lastSpin.collapsedWin;
			else
				currentSpin.collapsedWin = win;
		}

		if (winReceived > 0 && currentSession.collapsedWin > 0) {
			if (!isFreeSpinStart)
				currentSpin.tumbleMultiplier = Math.round(winReceived * 100 / currentSpin.collapsedWin) / 100;
			else {
				currentSpin.win = winStr;
				currentSpin.winVal = win;
				currentSpin.betMultiplier = betMultiplier;
				if (lastSpin)
					currentSpin.collapsedWin = lastSpin.collapsedWin + winReceived;
			}
			if (XT.GetBool(Vars.WinLimitReached))
				currentSpin.tumbleMultiplier = -currentSpin.tumbleMultiplier;

			// if (currentSpin.tumbleMultiplier != 1) {
			// 	currentSpin.collapsedWin = winReceived;
			// }
		}

		if (!response.IsFreeSpin)
			lastRoundWin = currentSpin.collapsedWin;

		sessionData.push(currentSpin);

		currentSpin.startTumble = currentSession.index;
		currentSession.roundEnd = spinIndex;

		ready[CHECK.COLLAPSE] = false;
		if (isFreeSpinStart) {
			tumbleWithFS = currentSpin;
			currentFSSEssion = currentSession;
			if (currentSpin.betValue == undefined || currentSpin.betValue == 0)
				currentSpin.betValue = currentSession.betValue;

			addTumbleWinToFS();
			latestSessionToCollapse = currentSpin;
		} else {
			latestSessionToCollapse = currentSpin;
			if (response.IsFreeSpin && currentFSSEssion)
				addTumbleWinToFS();
		}

		addAdditionalSpins(response);
		injectSpinRow(currentSpin);
		currentSession = null;

		if (response.IsFreeSpin)
			roundIndex++;

	} else {
		if (response.IsFreeSpin && !response.IsLastFreeSpin && !isBonusGame)
			balanceStr = "";

		currentSpin = new Spin(spinIndex,winStr,win,betValue,baseBet,betMultiplier,balanceStr,"","","",(response.IsFreeSpin ? (isFreeSpinStart ? "FreeSpinsStart" : (response.IsLastFreeSpin ? "LastFreeSpin" : "FreeSpins")) : ""));
		sessionData.push(currentSpin);
		currentSpin.roundIndex = roundIndexStr;
		if (win > 0 && !response.IsFreeSpin) {
			lastRoundWin = win;
		}

		if (response.IsFreeSpin && currentFSSEssion) {
			if (currentSpin.win != 0)
				currentFSSEssion.collapsedWinFS += (+currentSpin.winVal);
		} else if (currentSpin.freeSpinState == "FreeSpinsStart") {
			currentFSSEssion = currentSpin;
			if (currentFSSEssion.win == 0)
				currentFSSEssion.collapsedWinFS = 0;
			else
				currentFSSEssion.collapsedWinFS = (+currentFSSEssion.winVal);
		}

		addAdditionalSpins(response);
		injectSpinRow(currentSpin);

		setReady(CHECK.COLLAPSE);
		if (response.IsFreeSpin)
			roundIndex++;

	}

	currentSpin.round = totalSpinsCount[PROCESSED];
	spinIndex++;
	oldTumbleState = tumble;

	if (currentSpin.startTumble != undefined)
		currentSpin.betValue = sessionData[currentSpin.startTumble - 1].betValue;

	if (response.rid && (currentSpin.freeSpinState == "FreeSpinsStart" || (currentSpin.freeSpinState == "" && (currentSpin.tumblingState == "TumbleStart" || currentSpin.tumblingState == ""))))
		currentSpin.rid = response.rid;

	if (currentSpin.freeSpinState == "FreeSpinsStart") {
		currentFSSEssion.maxSpins = response.maxSpins;
		currentSpin.additionalSpins = currentFSSEssion.maxSpins;
		inFS = true;
	}

	if (currentSpin.additionalSpins != undefined && currentSpin.additionalSpins > 0) {
		showAdditionalFS(currentSpin, currentSpin.additionalSpins);
	}

	if (testIndex < inputJson.length) {
		callFakeSpinEndWithDelay(testIndex, 100);
		testIndex++;
	}

	if (currentFSSEssion)
		currentSpin.collapsedWinFS = currentFSSEssion.collapsedWinFS;

	if (response.maxWin) {
		currentSpin.maxWin = true;
		currentSpin.betMultiplier = hyperTexts.max[langIDX];
		currentSpin.collapsedWinFS = response.data.winAmount;
		if (currentSpin.freeSpinState == "")
			currentSpin.collapsedWin = response.data.winAmount;
		currentSpin.win = "";
	}

	if ((currentSession != null && currentSession.collapsedWin > 0) || (currentFSSEssion != undefined && currentFSSEssion.collapsedWinFS > 0)) {
		var sessionDiv;
		if (currentFSSEssion != undefined)
			sessionDiv = currentFSSEssion.div;
		else
			sessionDiv = currentSession.div;
		var spinState = getElementFromDiv(sessionDiv, "SpinState");
		if (spinState != undefined && spinState.className.indexOf("IsSimpleLose") >= 0) {
			var isBlack = spinState.className.indexOf("Black") >= 0;
			var extra = isBlack ? "Black" : "";
			spinState.classList.remove("IsSimpleLose" + extra);
			spinState.classList.add("IsSimpleWin" + extra);
		}
	}

	currentSpin.balanceNo = response.balance;

}

class Response {
	constructor(fsr, win, tumble, data) {
		if (fsr != null) {
			this.totalWinMultiplied = fsr._totalWinMultiplied;
			this.IsFreeSpin = fsr.IsFreeSpin;
			this.IsFreeSpinsStart = fsr.IsFreeSpinsStart;
			this.IsLastFreeSpin = fsr.IsLastFreeSpin;
			this.maxSpins = fsr._maxSpins;
			this.AdditionalSpins = fsr.AdditionalSpins;
		}
		this.roundID = XT.GetString("RoundId");
		this.win = win;
		//data.winAmount;
		this.tumble = tumble;
		this.data = data;
		this.baseBet = CoinManager.GetLastTotalBetBase();
		this.balance = XT.GetDouble(Vars.BalanceReceived);
	}
}

var isStartRound = function(spin) {
	if (spin.freeSpinState == "") {
		return (spin.tumblingState == "") || (spin.tumblingState == "TumbleStart");
	} else
		return (spin.freeSpinState == "FreeSpinsStart");
}

var getNextVisibleIndex = function(startIndex, step, limit) {
	var rowCount = 0;

	var endIndex = step > 0 ? -1 : sessionData.length;

	if (startIndex > sessionData.length - 1)
		startIndex = sessionData.length - 1;
	var lastVisible = undefined;
	for (var i = startIndex; i >= 0 && i < sessionData.length; i -= step) {
		var spin = sessionData[i];
		if (!spin.isCollapsed)
			lastVisible = i;

		if (isStartRound(spin))
			rowCount++;

		if (rowCount > limit || (limit == 0 && lastVisible != undefined)) {
			if (step < 0)
				return i;
			return lastVisible;
		}
	}

	return endIndex;
}

var limitTableSize = function() {
	if (isPaused)
		return;

	if (newRowsCount > 10 && roundsCount[PROCESSED] > rowLimit1) {
		// if (startLines.length > 0 && table.contains(startLines[0])) {
		// 	for (var i in startLines) {
		// 		table.removeChild(startLines[i]);
		// 	}
		// }

		var removed = 0;
		var diff = 0;
		visibleIndex[1] = getNextVisibleIndex(sessionData.length - 1, 1, rowLimit1 - 1);
		var removeFrom = getNextVisibleIndex(visibleIndex[1], 1, 1);
		for (var i = removeFrom; i > lastRemovedIndex; i--) {
			var div = sessionData[i].div;

			if (!table.contains(div))
				continue;

			//console.log("Hyperplay: limit table. removing index " + i);
			table.removeChild(div);
			if (sessionData[i].betValue > 0)
				sessionData[i].div = null;

			if (sessionData[i].height)
				diff += sessionData[i].height;
			else
				diff += row_height;
			removed++;
		}

		newRowsCount = 0;
		if (removed == 0)
			return;

		//visibleIndex[1] = getNextVisibleIndex(visibleIndex[1], -1, 1);
		lastRemovedIndex = removeFrom;
		fakeRowsHeight[1] += diff;
		fakeRows[1].style.height = fakeRowsHeight[1] + "px";
	}
}

var fakeRowIds = ["fakeUp", "fakeDown"];
var fakeRows = [null, null];
var fakeRowsHeight = [0, 0];
var addFakeRows = function() {
	for (i = 0; i < 2; i++) {
		if (fakeRows[i] == null) {
			var rowPayload = `
				<div class= "FakeRow" id=${fakeRowIds[i]}>
				</div>
			`;
			var htmlContent = new DOMParser().parseFromString(rowPayload, "text/html");
			fakeRows[i] = htmlContent.body.firstChild;
		}
	}

	if (startLines.length > 0)
		table.insertBefore(fakeRows[1], startLines[0]);
	else
		table.appendChild(fakeRows[1]);
}

var restoreTable = function(roundsToRestore) {
	var roundsRestored = 0;
	var i = lastRemovedIndex;
	for (; i >= 0; i--) {
		if (roundsRestored >= roundsToRestore)
			break;

		var spin = sessionData[i];
		if (spin.isCollapsed)
			continue;

		if (isStartRound(spin))
			roundsRestored++;
		//console.log("Hyperplay: limit table. restoring index " + i);
		if (spin.div == null)
			spin.div = createDivOfType(spin, "Row");
		table.appendChild(spin.div);
	}

	visibleIndex[1] = lastRemovedIndex + 1;
	lastRemovedIndex = i;
	newRowsCount = roundsCount[PROCESSED];
	if (i == -1) {
		if (startLines.length > 0 && !table.contains(startLines[0])) {
			for (var i in startLines) {
				table.appendChild(startLines[i]);
			}
		}
	}
};

HPVARS.FSPICK = {
	NONE: 0,
	CHOSEN: 1,
	REVEALED: 2,
	PLAYING: 3
};
HPVARS.pickStatus = HPVARS.FSPICK.NONE;
HPVARS.mysteryDiv = null;

var continueWithFeatureAfterTimeout = function(timeInMS) {
	HPVARS.pickStatus = HPVARS.FSPICK.REVEALED;
	setTimeout(function() {
		continueWithFeature();
	}, timeInMS);
}

var onFSOptionSelected = function(fsPick) {
	var div = document.getElementById("fsOptions");
	if (div == undefined)
		return;

	var items = div.children;
	for (i = 0; i < items.length; i++) {
		var child = items[i];

		if (i == fsPick) {
			if (HPVARS.hasManualSelection || fsPick == HPVARS.mysteryPickIndex)
				child.classList.add("fadeOutTextBlack");
		} else {
			if (HPVARS.hasManualSelection)
				child.classList.add("fadeOutTextBlack");

			if (i == HPVARS.mysteryPickIndex) {
				if (!HPVARS.onlyRevealMysteryIfPicked)
					child.classList.add("fadeOutTextWhite");
				child.style.opacity = 0.6;
			} else
				child.style.opacity = 0.4;
		}
	}
}

var continueWithFeature = function() {
	if (HPVARS.pickStatus == HPVARS.FSPICK.CHOSEN || HPVARS.pickStatus == HPVARS.FSPICK.PLAYING)
		return;

	if (HPVARS.playingFeature)
		return;

	if (HPVARS.fsOptions.length > 0 && HPVARS.pickStatus != HPVARS.FSPICK.REVEALED) {
		var fsPick = XT.GetInt(HPVARS.FSBGPickIndex);
		if (fsPick < 0)
			return;

		onFSOptionSelected(fsPick);

		HPVARS.pickStatus = HPVARS.FSPICK.CHOSEN;

		var trigTimeout = HPVARS.mysteryPickIndex < 0 ? (HPVARS.hasManualSelection ? 200 : 0) : 150;
		setTimeout(function() {
			if ((HPVARS.hasManualSelection || HPVARS.useColliders) && HPVARS.fsColliders && HPVARS.fsColliders[fsPick] != undefined)
				HPVARS.fsColliders[fsPick].OnClick();
			else
				XT.TriggerEvent(HPVARS.FSBGPickEvent);
		}, trigTimeout);

		return;
	}

	HPVARS.playingFeature = true;
	spinTimer = 0;
	var stopOnFeatureEl = document.getElementById("stopOnFeature");
	stopOnFeatureEl.style.display = "none";
	if (HPVARS.pickStatus != HPVARS.FSPICK.NONE)
		HPVARS.pickStatus = HPVARS.FSPICK.PLAYING;

	if (!HPVARS.callFinalizeDisplayedWin)
		XT.SetBool(Vars.CanAnimateValues, false);
	playingFeatureInGame = false;
	doingNormalFrames = false;
	for (var i in pausedClickers) {
		var clicker = pausedClickers[i].clicker;
		clicker.started = true;
		clicker.timeLeft = 0;
		clicker.Update();
	}
	pausedClickers = [];

	globalTracking.SendEvent("uht_hyperplay", "FeaturePlayed_InGame", 0, "BehaviourTracker");
	XT.SetBool(Vars.Autoplay_SkipScreens, true);
	XT.SetBool(Vars.AutoplayContinuousSpin, true);

	//HyperplaySound("bonus_music");
}

var playFeatureInGame = function() {
	spinTimer = -1;
	HPVARS.playingFeature = true;
	playingFeatureInGame = true;
	var stopOnFeatureEl = document.getElementById("stopOnFeature");
	stopOnFeatureEl.style.display = "none";

	globalTracking.SendEvent("uht_hyperplay", "FeaturePlayed_InGame", 1, "BehaviourTracker");
	restoreGame();
	globalRenderer.doFrame();
}

var returnToHyperplay = function() {}

var indexForAutoSelectFSOption = 0;
var addFSOptionButton = function(parent, index) {
	var className = HPVARS.hasManualSelection ? "fsManualOpt" : "fsOption";
	var rowPayload = `
				<div class=${className}></div>
			`;

	var htmlContent = new DOMParser().parseFromString(rowPayload, "text/html");
	var div = parent.appendChild(htmlContent.body.firstChild);
	div.innerHTML = HPVARS.fsOptions[index];
	if (HPVARS.mysteryPickIndex == index)
		HPVARS.mysteryDiv = div;

	var maxIndex = HPVARS.fsOptions.length - 1;
	if (!HPVARS.hasManualSelection && index < maxIndex) {
		//- the half the border
		var hRatio = Math.round(HPVARS.fsOptH * (maxIndex - index) * 100) / 100 - 0.1;
		var wRatio = Math.round(HPVARS.fsOptW * (maxIndex - index) * 100) / 100 - 0.21;
		div.style.bottom = "min(" + wRatio + "vw, " + hRatio + "vh)";
	} else {// div.classList.add("selectedFS");
	// XT.SetInt(HPVARS.FSBGPickIndex, index);
	}

	addOnHover(div, "hoverFS", "selectedFS");
	div.onclick = function() {
		if (HPVARS.pickStatus >= HPVARS.FSPICK.CHOSEN)
			return;

		var fsDivs = parent.querySelectorAll("." + className);
		var continueHereEl = document.getElementById("continueHere");
		for (var j = 0; j < fsDivs.length; j++) {
			var otherDiv = fsDivs[j];
			if (otherDiv == div)
				continue;

			continueHereEl.style.opacity = "";
			otherDiv.classList.remove("selectedFS");
		}

		div.classList.add("selectedFS");
		//parent.classList.remove("pulse2");

		XT.SetInt(HPVARS.FSBGPickIndex, index);
		if (HPVARS.hasManualSelection) {
			continueWithFeature();
		}
	}

	var hyperType = IsRequired("HYPERPLAY");
	var hpFlags = IsRequired("HPFLAGS");
	if (hpFlags && hpFlags[0].indexOf("AUTO") >= 0 && hyperType == "DEV" && +index == indexForAutoSelectFSOption) {
		setTimeout(function() {
			div.onclick();
			var continueHereEl = document.getElementById("continueHere");
			setTimeout(function() {
				if (continueHereEl != undefined)
					continueHereEl.onclick();

				indexForAutoSelectFSOption++;
				if (indexForAutoSelectFSOption >= HPVARS.fsOptions.length)
					indexForAutoSelectFSOption = 0;
			}, 1000);
		}, 2000);
	}
}

var doStopOnFeature = function() {
	if (HPVARS.playingFeature || (waitForFSOptions() && HPVARS.fsOptions.length == 0)) {
		return;
	}

	if (isReconnecting)
		removeErrOverlay();
	spinTimer = -1;

	var stopOnFeatureEl = document.getElementById("stopOnFeature");

	var fsOptionsDiv = document.getElementById("fsOptions");
	var continueHereEl = document.getElementById("continueHere");

	var selectFeatureEl = document.getElementById("selectFeature");

	if (HPVARS.fsOptions.length > 0) {
		var hRatio, wRatio;
		var extraH = 0;
		var extraW = 0;
		if (HPVARS.manualSelectionCount > 0) {
			continueHereEl.style.display = "none";
			if (fsOptionsDiv.className.indexOf("bonusOptions") < 0) {
				fsOptionsDiv.classList.remove("featureOptions");
				fsOptionsDiv.classList.add("bonusOptions");
			}

			var rows = Math.ceil(HPVARS.manualSelectionCount / 3);

			hRatio = Math.round((HPVARS.rowGapH + HPVARS.fsManualOptH) * rows * 100) / 100;
			wRatio = Math.round((HPVARS.rowGapW + HPVARS.fsManualOptW) * rows * 100) / 100;

			extraH = -7;
			extraW = -15.2;

			fsOptionsDiv.style.bottom = "min(32.6vw, 15vh)";
			fsOptionsDiv.style.display = "grid";
		} else {
			hRatio = Math.round(HPVARS.fsOptH * HPVARS.fsOptions.length * 100) / 100;
			wRatio = Math.round(HPVARS.fsOptW * HPVARS.fsOptions.length * 100) / 100;

			continueHereEl.style.opacity = "0.5";
			fsOptionsDiv.style.display = "flex";
		}

		var vhVal = 39 + hRatio + extraH;
		var vwVal = 77 + wRatio + extraW;
		var fsH = "min(" + vwVal + "vw, " + vhVal + "vh)";
		document.body.style.setProperty('--fsH', fsH);

		selectFeatureEl.innerHTML = hyperTexts.selectFeatureText[langIDX];

		vhVal = 27 + hRatio + extraH;
		vwVal = 55 + wRatio + extraW;
		var fsBottomVal = "min(" + vwVal + "vw, " + vhVal + "vh)";
		document.body.style.setProperty('--fsBottom', fsBottomVal);

		vhVal = vhVal - 5;
		vwVal = vwVal - 9;
		var fsSelectVal = "min(" + vwVal + "vw, " + vhVal + "vh)";
		document.body.style.setProperty('--fsSelect', fsSelectVal);

		var optionsH = "min(" + wRatio + "vw, " + hRatio + "vh)";
		HPVARS.bottomFS = optionsH;
		fsOptionsDiv.style.height = optionsH;

		//fsOptionsDiv.classList.add("pulse2");
		fsOptionsDiv.innerHTML = "";

		for (var i in HPVARS.fsOptions)
			addFSOptionButton(fsOptionsDiv, i);
		HPVARS.mustRefitLabels = true;
	} else {
		continueHereEl.style.opacity = "";
		document.body.style.setProperty('--fsH', "31em");
		document.body.style.setProperty('--fsSelect', "min(68vw, 32vh)");
		document.body.style.setProperty('--fsBottom', "min(65vw, 30vh)");
		fsOptionsDiv.style.display = "none";
		selectFeatureEl.innerHTML = "";
	}

	refitAllLabels();
	stopOnFeatureEl.style.display = "block";
	stopGoldLoopSound();
	HyperplaySound("bonus_round_trigg");
}

var updateCurrentCredit = function(balance) {
	currentSpin.balance = LocaleManager.FormatValue(balance, new FormatOptions());
	currentSpin.balanceNo = balance;
	getElementFromDiv(currentSpin.div, "Credits").children[0].innerHTML = currentSpin.balance;
}

var updateWin = function() {
	if (lastRoundWin > 0) {
		totalWin += lastRoundWin;
		totalWinValue.innerHTML = LocaleManager.FormatValue(totalWin, new FormatOptions());
	}
	lastRoundWin = 0;
}

var processRoundEnd = function(response) {
	if (!lastRoundEnded[PROCESSED]) {
		roundIndexes[roundsCount[PROCESSED]] = sessionData.length - 1;
		roundsCount[PROCESSED]++;

		newRowsCount++;
		limitTableSize();
	}

	lastRoundEnded[PROCESSED] = true;
	//console.log("HYPERPLAY gameRoundEnded win +=" + lastRoundWin);

	var fsOptionsDiv = document.getElementById("fsOptions");
	if (fsOptionsDiv != undefined)
		fsOptionsDiv.innerHTML = "";
	HPVARS.pickStatus = HPVARS.FSPICK.NONE;
	if (mustHandleFSStart)
		doStopOnFeature();

	var IsLastFreeSpin = false;
	if (currentSpin) {
		if (currentSpin.freeSpinState == "LastFreeSpin") {
			IsLastFreeSpin = true;
			setCallbackAtTheEndOfFS();
		} else {
			if (currentSpin.tumblingState == "" && currentSpin.freeSpinState == "") {
				var targetWin = currentSpin.winVal;
				if (Math.round(currentSpin.balanceNo * 100) / 100 != Math.round((lastCredit + targetWin - currentSpin.betValue) * 100) / 100)
					logCreditError();
			}
			lastCredit = currentSpin.balanceNo;
		}
	}

	if (!IsLastFreeSpin)
		updateWin();

	if (savedSpinsLeft > 0 && roundsCount[SPUN] - roundsCount[PROCESSED] <= 1) {
		//console.log("HYPERPLAY: ahead. Set AutoplaySpinsLeft to " + savedSpinsLeft);
		XT.SetInt(Vars.AutoplaySpinsLeft, savedSpinsLeft);
		savedSpinsLeft = -1;
	}

	if (mustTryNextSpin && roundsCount[SPUN] - roundsCount[PROCESSED] <= 1) {
		mustTryNextSpin = false;
		startNextSpin();
	}

	setReady(CHECK.EXPAND);
	setReady(CHECK.COLLAPSE);
	setReady(CHECK.ROUNDEND);
}

