var inTumble = false;
var playingFreeSpins = false;
var messagesNeeded = ["gameRoundStarted", "spinEnded", "gameRoundEnded", "visualBalanceUpdate"]

var roundsToProcess = [];
var lastBalance = -1;
var processRoundData = function() {
	if (roundsToProcess.length == 0)
		return;

	if (roundsToProcess[0].bonusGameStarted)
		return;

	var roundData = roundsToProcess.shift();

	lastWinInRound = 0;
	lastWinInTumble = 0;

	var initBalance = roundData["gameRoundStarted"];
	if (lastBalance > -1 && initBalance != lastBalance) {
		initBalance = lastBalance;
	}

	var spinData = roundData["spinEnded"];
	var betValue;
	if (roundData["betAtStart"] != undefined)
		betValue = roundData["betAtStart"];
	else
		betValue = spinData.data.betAmount;
	var balanceAfterSpin = Math.round((initBalance - betValue) * 100) / 100;

	var endData = roundData["gameRoundEnded"];
	if (XT.GetBool(Vars.WinLimitReached))
		endData.maxWin = true;

	var balanceData = roundData["visualBalanceUpdate"];
	var newBalance = balanceData.params.newAmount;
	if (newBalance == balanceAfterSpin && balanceData.params.win > 0) {
		newBalance = newBalance + balanceData.params.win;
	}

	newBalance = Math.round(newBalance * 100) / 100;

	var maxWin = endData.maxWin;

	if (maxWin) {
		spinData.maxWin = true;
		spinData.data.winAmount = balanceData.params.win;
	}

	spinData.balance = newBalance;
	handleResponse(spinData);

	endData.balance = newBalance;
	handleResponse(endData);

	lastBalance = newBalance;
	if (roundsToProcess.length > 0)
		roundsToProcess[0]["gameRoundStarted"] = newBalance;

	lastRoundEnded[SPUN] = false;
}

var isReadyToProcess = function(roundData) {
	for (var i in messagesNeeded) {
		if (roundData[messagesNeeded[i]] == undefined)
			return false;

		if (messagesNeeded[i] == "spinEnded") {
			if (roundData[messagesNeeded[i]].win < 0)
				return false;
		}
	}

	return true;
}

var addRoundStep = function(step, data) {
	if (roundsToProcess.length == 0)
		return;
	var indexRound = 0;
	if (step == "spinEnded") {
		while (indexRound < roundsToProcess.length) {
			if (roundsToProcess[indexRound]["spinEnded"] == undefined)
				break;
			indexRound++;
		}
	}

	if (indexRound >= roundsToProcess.length)
		indexRound = roundsToProcess.length - 1;
	var roundData = roundsToProcess[indexRound];
	if (step == "waitRoundEnd") {
		roundData["visualBalanceUpdate"] = undefined;
		roundData["spinEnded"] = undefined;
		roundData[step] = true;
		roundData["betAtStart"] = data;
		return;
	}

	if (step != "spinEnded" && roundData["spinEnded"] == undefined) {
		//console.log("this was from a prev processed spin!!");
		return;
	}

	roundData[step] = data;

	if (isReadyToProcess(roundData))
		processRoundData();
}

var GetResponseRID = function() {
	var fox_response = XT.GetObject(FOXVars.FOX_Response);
	if (fox_response && fox_response.rid)
		return fox_response.rid;
	else
		return VerifyGameAuthenticityManager.rid;
}

var mustHandleFSStart = false;
var bonusGameStarted = false;
var bonusGameWin = 0;
var lastWinInRound = 0;
var lastWinInTumble = 0;

var handleSpinWin = function() {
	if (roundsToProcess.length > 0 && roundsToProcess[0].spinEnded) {
		var roundData = roundsToProcess[0];
		var spinData = roundData.spinEnded;
		setWinReceived(spinData);

		var tumble = spinData.tumble;
		if ((spinData.IsLastFreeSpin && !tumble) || (!spinData.IsFreeSpin && !tumble && !bonusGameStarted)) {
			//&& (inTumble || winReceived > 0)
			if (isReadyToProcess(roundData)) {
				processRoundData();
			}
		} else {
			addRoundStep("waitRoundEnd", spinData.data.betAmount);
			handleResponse(spinData);
		}
	}
}

var setWinReceived = function(response) {
	if (response.win >= 0)
		return;

	var spinWin, winReceived;
	if (HPVARS.useFoxForSpinResponse) {
		spinWin = XT.GetDouble(Vars.SpinCycleWinReceivedHP);
		winReceived = XT.GetDouble(Vars.WinReceivedHP);
	} else {
		spinWin = XT.GetDouble(Vars.SpinCycleWinReceived);
		winReceived = XT.GetDouble(Vars.WinReceived);
	}

	var tumble = response.tumble;
	if ((winReceived > 0 || spinWin > lastWinInRound) && spinWin > 0) {
		if (winReceived == response.totalWinMultiplied && response.IsLastFreeSpin)
			winReceived = spinWin - lastWinInRound;
		else if (tumble || !inTumble || response.IsFreeSpinsStart) {
			winReceived = spinWin - lastWinInRound;
		} else if (!tumble) {
			if (inTumble) {
				if (HPVARS.useFoxForSpinResponse)
					winReceived = spinWin - lastWinInTumble;
			}
		}
	}

	if (winReceived < 0)
		winReceived = 0;

	lastWinInRound = spinWin;

	if (!tumble)
		lastWinInTumble = spinWin;

	response.win = winReceived;
	if (XT.GetBool(Vars.WinLimitReached)) {
		response.maxWin = true;
		response.IsLastFreeSpin = true;
	}

}

var onMessageReceived = function(event) {
	if (!inHyperplay && !playingFeatureInGame)
		return;

	if (!setupDone || limbo)
		return;

	if (event.data != null) {
		//if (event.data.name != undefined)
		//	console.log("HYPERPLAY message: " + event.data.name);
		//else
		//	console.log("HYPERPLAY message: " + event.data.event);

		var response = undefined;
		if (event.data.name == "gameRoundStarted") {
			spinTimer = 0;
			if (isReconnecting)
				removeErrOverlay();

			totalSpinsCount[SPUN]++;
			currentSpinsCount[SPUN]++;
			mustGetWinnings = true;
			lastRoundEnded[SPUN] = false;
			//console.log("HYPERPLAY totalSpinsCount SPUN " + totalSpinsCount[SPUN]);

			var newRoundData = {};
			newRoundData["gameRoundStarted"] = XT.GetDouble(Vars.BalanceReceived) + XT.GetDouble(Vars.BonusBalanceReceived);
			roundsToProcess.push(newRoundData);
		} else if (event.data.event == "visualBalanceUpdate") {
			addRoundStep("visualBalanceUpdate", event.data);
		} else if (event.data.name == "gameRoundEnded") {
			handleSpinWin();
			if (XT.GetInt(HPVARS.FSBGPickIndex) >= 0)
				XT.SetInt(HPVARS.FSBGPickIndex, -1);

			XT.SetBool(Vars.AutoplayContinuousSpin, true);

			HPVARS.spinMAXTime = 10;
			bonusGameWin = 0;
			inTumble = false;
			playingFreeSpins = false;
			if (inHyperplay)
				HPVARS.playingFeature = false;
			HPVARS.additionalFSTrigger = false;

			spinTimer = -1;
			if (isReconnecting)
				removeErrOverlay();

			if (noMoney) {
				setReady(CHECK.EXPAND);
				setReady(CHECK.COLLAPSE);
				setReady(CHECK.ROUNDEND);
				return;
			}

			if (!lastRoundEnded[SPUN])
				roundsCount[SPUN] = roundsCount[SPUN] + 1;
			lastRoundEnded[SPUN] = true;

			response = new Response(null,0,false,event.data);
			addRoundStep("gameRoundEnded", response);

			if (mustSetAnteBet) {
				afterRoundEnd = true;
				setAnteBet(betLevelToggle);
				updateBetValue();
				afterRoundEnd = false;
			}

		} else if (event.data.name == "freeSpinStarted") {
			var fsr = XT.GetObject(Vars.ReceivedFreeSpinsResponse);
			if (fsr != undefined && fsr._maxSpins > 0 && roundsToProcess.length > 0 && roundsToProcess[0].spinEnded) {
				var response = roundsToProcess[0].spinEnded;
				response.IsFreeSpin = true;

				if (HPVARS.additionalFSTrigger) {
					response.maxSpins = 0;
					response.AdditionalSpins = fsr._maxSpins;
					response.IsFreeSpinsStart = false;
					response.IsLastFreeSpin = false;
					response.isRetriggerFS = true;
				} else {
					response.maxSpins = fsr._maxSpins;
					response.AdditionalSpins = fsr.AdditionalSpins;
					response.IsFreeSpinsStart = true;
					response["bonusGame"] = true;
				}

				if (response.win < 0)
					setWinReceived(response);
				roundsToProcess[0]["visualBalanceUpdate"] = undefined;
				response.rid = GetResponseRID();
				roundsToProcess[0].spinEnded = undefined;
				handleResponse(response);
			}

			if (stopOnFeature && !waitForFSOptions())
				onFreeSpinsStart();

		} else if (event.data.name == "bonusGameStarted") {
			lastWinInRound = 0;
			lastWinInTumble = 0;
			addRoundStep("bonusGameStarted", true);
			bonusGameStarted = true;
			if (stopOnFeature && !waitForFSOptions())
				onFreeSpinsStart();
		} else if (event.data.name == "bonusGameEnded") {
			bonusGameStarted = false;
			var fsr = XT.GetObject(Vars.ReceivedFreeSpinsResponse);
			bonusGameWin = event.data.winAmount;
			lastWinInRound = bonusGameWin;
			lastWinInTumble = 0;
			var response;
			if (roundsToProcess.length > 0 && roundsToProcess[0].spinEnded) {
				roundsToProcess[0]["bonusGameStarted"] = false;
				response = roundsToProcess[0].spinEnded;
				response.maxSpins = fsr._maxSpins;
				response.AdditionalSpins = fsr.AdditionalSpins;
				if (response.win < 0)
					setWinReceived(response);

				if (response.maxSpins > 0) {
					roundsToProcess[0].spinEnded = undefined;
					response.IsFreeSpin = true;
					response.IsFreeSpinsStart = true;
					var spinWin = XT.GetDouble(Vars.SpinCycleWinReceived);
					response.win = spinWin - response.lastWinInRound;
				}
			} else {
				var winReceived = event.data.winAmount;
				var tumble = XT.GetBool(Vars.IsDifferentSpinType);
				response = new Response(fsr,winReceived,tumble,event.data);
				response["bonusGame"] = true;
			}

			roundsToProcess[0].visualBalanceUpdate = undefined;
			handleResponse(response);

		} else if (event.data.name == "spinEnded") {
			if (spinTimer > 0)
				spinTimer = 0;
			if (isReconnecting)
				removeErrOverlay();

			if (noMoney) {
				setReady(CHECK.EXPAND);
				setReady(CHECK.COLLAPSE);
				setReady(CHECK.ROUNDEND);
				return;
			}

			afterRoundEnd = false;

			var fsr = XT.GetObject(Vars.ReceivedFreeSpinsResponse);
			var tumble = XT.GetBool(Vars.IsDifferentSpinType);

			if (tumble)
				inTumble = true;

			response = new Response(fsr,-1,tumble,event.data);
			response.lastWinInRound = lastWinInRound;
			if (HPVARS.useFoxForSpinResponse)
				setWinReceived(response);

			if (response.IsFreeSpinsStart || response.IsFreeSpin || response.IsLastFreeSpin) {
				if (!playingFreeSpins) {
					if (!response.IsFreeSpinsStart)
						response.IsFirstFreeSpin = true;
					playingFreeSpins = true;
				}
			}
			if (response.IsFreeSpinsStart && stopOnFeature && !waitForFSOptions()) {
				onFreeSpinsStart();
			}

			response.rid = GetResponseRID();
			if (XT.GetBool(Vars.WinLimitReached))
				response.maxWin = true;

			addRoundStep("spinEnded", response);

			var gamesToForceRoundEnded = ["vs10jokerhot", "vs10jokerhotlim", "vs10jokerhot_cv96"];
			if (gamesToForceRoundEnded.indexOf(UHT_GAME_CONFIG.GAME_SYMBOL) >= 0) {
				if (XT.GetBool(Vars.MustOpenBonus))
					UHTInterfaceBOSS.PostMessage("gameRoundEnded");
			}
		}
	}
}

var removePauseRow = function() {
	if (table != undefined && table.children.length > 0 && pauseDiv != undefined) {
		if (table.children[0].classList.contains("bgPause"))
			table.removeChild(pauseDiv);
	}
}

var resetTopVisibleIndex = function() {
	if (stillProcessing())
		return;

	if (sessionData.length == 0)
		return;

	visibleIndex[0] = sessionData[sessionData.length - 1].index - 1;
	table.insertBefore(fakeRows[0], table.children[0]);
}

var stopSession = function() {
	if (isPaused)
		return;

	isPaused = true;
	resetTopVisibleIndex();

	var timeout = 0;
	if (XT.GetInt(Vars.AutoplaySpinsLeft) > -1) {
		XT.SetInt(Vars.AutoplaySpinsLeft, -1);
		timeout = 300;
		mustPause = true;
	}

	if (inHyperplay) {
		setPlayingStatus(PLAYING_STATUS.PAUSING);
		setReady(CHECK.AUTOSPIN);
		setTimeout(pauseFirstRow, timeout);
	} else {
		setPlayingStatus(PLAYING_STATUS.PAUSED);
	}

	savedSpinsLeft = -1;

	table.classList.remove('stop-scrolling');
	table.classList.add('with-scrolling');
	lastFakeRow.style.height = "19.4em";
}

var startNextSpin = function() {
	if (!canStartNextSpin)
		return;

	if (!ready[CHECK.AUTOSPIN]) {
		mustStartNextSpin = true;
		return;
	}
	mustStartNextSpin = false;

	if (isPaused || isSessionDone()) {
		if (mustPause)
			pauseFirstRow();

		return;
	}

	mustPause = false;

	ready[CHECK.AUTOSPIN] = false;
	spinsRequested = spins;

	console.log("HYPERPLAY: startNextSpin x" + spinsRequested + "; spins done = " + currentSpinsCount[SPUN]);
	XT.SetInt(Vars.AutoplaySpinsRequested, spinsRequested);
	XT.TriggerEvent(Vars.Evt_DataToCode_StartAutoplay);
	afterRoundEnd = false;
}

var isSessionDone = function() {
	return mustCloseHyperplay || (currentSpinsCount[SPUN] >= spins && spins <= maxSpins);
}

var setPlayingStatus = function(playing) {
	var playButton = document.getElementById("PlayButton");
	var innerIcon = document.getElementById("btnInnerIcon");

	var innerStatusEl = document.getElementById("InnerStatus");
	innerStatusEl.style.width = "";
	var textEl = document.getElementById("StatusText");
	var statusEl = document.getElementById("Status");
	var extraEl = document.getElementById("ExtraStatus");
	if (playing == PLAYING_STATUS.PLAYING) {
		statusEl.classList.remove("StatusReady");
		statusEl.classList.remove("StatusPaused");
		statusEl.classList.add("StatusPlaying");

		extraEl.classList.remove("extraPaused");
		extraEl.classList.add("extraPlaying");
		extraEl.classList.add("active");
		extraEl.classList.remove("inactive");

		textEl.innerHTML = hyperTexts.playing[langIDX];
		textEl.style.width = "85%";
		textEl.style.marginLeft = "2%";
		innerStatusEl.style.width = "80%";

		playButton.classList.remove("pulse");
		playButton.classList.remove("pulse1");
		playButton.classList.remove("PlayButton");
		playButton.classList.add("StopButton");

		innerIcon.className = "pauseIcon";
		innerIcon.style.opacity = "";
	} else if (playing == PLAYING_STATUS.PAUSED || !stillProcessing()) {
		afterRoundEnd = true;
		statusEl.classList.remove("StatusPlaying");
		innerIcon.className = "playIcon";
		innerIcon.style.opacity = "";

		if (currentSpinsCount[SPUN] == 0 || (currentSpinsCount[SPUN] >= spins && spins <= maxSpins)) {
			statusEl.classList.remove("StatusPaused");
			statusEl.classList.add("StatusReady");
			textEl.innerHTML = hyperTexts.ready[langIDX];
			textEl.style.width = "100%";
			textEl.style.marginLeft = "";

			extraEl.classList.add("inactive");
			extraEl.classList.remove("active");
		} else {
			statusEl.classList.remove("StatusReady");
			statusEl.classList.add("StatusPaused");
			textEl.innerHTML = hyperTexts.paused[langIDX];
			textEl.style.width = "90%";
			textEl.style.marginLeft = "5%";

			extraEl.classList.remove("extraPlaying");
			extraEl.classList.add("extraPaused");
			extraEl.classList.remove("inactive");
			extraEl.classList.add("active");
		}

		playButton.classList.remove("StopButton");
		playButton.classList.add("PlayButton");
		playButton.classList.add("pulse");
	} else {
		//PAUSING
		innerIcon.className = "pauseIcon";
		innerIcon.style.opacity = "0.35";

		if (stillProcessing() || !setupInited) {
			playButton.classList.remove("pulse");
			playButton.classList.remove("pulse1");
			playButton.classList.remove("PlayButton");
			playButton.classList.add("StopButton");

			if (!setupInited) {
				statusEl.classList.remove("StatusPaused");
				statusEl.classList.remove("StatusPlaying");
				statusEl.classList.add("StatusReady");
				textEl.innerHTML = hyperTexts.ready[langIDX];
				textEl.style.width = "100%";
				textEl.style.marginLeft = "";
			} else {
				textEl.style.width = "85%";
				textEl.style.marginLeft = "2%";
				innerStatusEl.style.width = "80%";
			}
		}
	}

	fitStatusText();
}

