var startSession = function() {
	if (!setupInited)
		return;
	var playBtn = document.getElementById("PlayButton");
	onPlayReleased();
	if (playBtn.className.indexOf("StopButton") > -1) {
		userPaused = true;
		stopSession();
		return;
	}

	if (spins <= 0)
		return;

	limbo = false;
	updateLatestBetSet();
	HyperplaySound("play_hyperplay");
	pauseRowAddded = false;
	noMoney = false;
	onSetupDone();

	isPaused = false;
	mustPause = false;
	removePauseRow();

	if (table.contains(fakeRows[0]))
		table.removeChild(fakeRows[0]);
	fakeRowsHeight[0] = 0;

	if (isSessionDone()) {
		currentSpinsCount[SPUN] = 0;
		currentSpinsCount[PROCESSED] = 0;
	}

	if (currentSpinsCount[SPUN] == 0) {
		tmpCurrentSpins = 0;
		roundTrackedIndex = roundsCount[SPUN];

		var eventID = "StartWith" + spins + "_New";
		globalTracking.SendEvent("uht_hyperplay", eventID, freshSession ? 1 : 0, "BehaviourTracker");
		freshSession = false;
	}

	setPlayingStatus(PLAYING_STATUS.PLAYING);

	restoreRows(0, 2000);
	table.scrollTo({
		left: 0,
		top: 0,
		behavior: "smooth"
	});
	//auto
	scrollPosition = 0;

	XT.SetBool(Vars.AutoplayContinuousSpin, true);
	startNextSpin();

	table.classList.remove('with-scrolling');
	table.classList.add('stop-scrolling');
	lastFakeRow.style.height = "100%";
	removeReplayButtons();
}

