var oSoundVolume = -1;
var hyperplayMusicRatio = 0.25;
var soundMgr = null;
var prepareSound = function() {
	if (o_SMUMV == null && window["SoundManager"]) {
		o_SMUMV = SoundManager.prototype.UpdateMusicVolume;
		SoundManager.prototype.UpdateMusicVolume = function() {
			for (var i = 0; i < this.musicClips.length; i++) {
				var newVolume = this.musicClips[i].GetVolume() * this.volumeMusic * this.internalVolumeMusic;
				if (inHyperplay)
					newVolume = newVolume * hyperplayMusicRatio;
				if (this.musicSoundSource[this.musicClips[i].handler].volume != newVolume)
					this.musicSoundSource[this.musicClips[i].handler].volume = newVolume;
			}
		}
	}

	if (oSoundVolume >= 0)
		return;
	soundMgr = XT.GetObject(Vars.SoundManagerObject);
	oSoundVolume = XT.GetFloat(Vars.SoundVolume);
	var soundState = XT.GetObject(Vars.SoundState);
	if (soundState.soundFXIsOn) {
		oSoundFXOn = true;
		soundMgr.MuteSoundFX();
	}
}

