var setParticleSize = function() {
	if (canvas == undefined)
		return;

	particleW = Math.round(Math.min(0.09 * window.innerWidth, 0.037 * window.innerHeight)) * devicePixelRatio;
	particleH = particleW * spriteH / spriteW;

	for (var i in mSprites) {
		var sprite = mSprites[i];
		sprite.paddingLeftScaled = Math.round(sprite.paddingLeft * particleW / spriteW);
		sprite.paddingTopScaled = Math.round(sprite.paddingTop * particleH / spriteH);
	}
}

