var addGameMode = function(index, gmDiv) {
	var t = globalRuntime.sceneRoots[1].transform.Find(gmRootPath + hp_gameModes[index].labelPath);
	if (t == null)
		return;
	var labels = t.GetComponentsInChildren(UILabel, true);
	var lblText = labels[0].text;
	htmlPayload = `
	<div class="gameMode">
		<div class="gameModeLabel">${lblText}</div>	
		<div class="gameModeIcon"></div>
	</div>
	`;

	var htmlContent = new DOMParser().parseFromString(htmlPayload, "text/html");
	var div = gmDiv.appendChild(htmlContent.body.firstChild);
	var iconDiv = getElementFromDiv(div, "gameModeIcon");

	var alphaVal = "0.5";
	var dataURL = 'data:image/png;base64,' + hp_gameModes[index].icon;
	iconDiv.style.backgroundImage = `url('${dataURL}')`;
	if (index == getCurrentGameModeForHP())
		iconDiv.style.opacity = "1";
	else
		iconDiv.style.opacity = alphaVal;

	iconDiv.onclick = function() {
		iconDiv.style.opacity = "1";
		switchGameModeFromHP(index);
		var gameModes = gmDiv.querySelectorAll(".gameMode");
		for (var j = 0; j < gameModes.length; j++) {
			var div = getElementFromDiv(gameModes[j], "gameModeIcon");
			if (div == iconDiv)
				continue;

			div.style.opacity = alphaVal;
		}
	}
}

var addGameModesDiv = function(parentDivID, className) {
	if (typeof hp_gameModes == 'undefined')
		return -1;

	var parentDiv = document.getElementById(parentDivID);
	var htmlPayload = `
		<div class="${className}">
		</div>	
	`;

	var htmlContent = new DOMParser().parseFromString(htmlPayload, "text/html");
	var gmDiv;
	if (parentDiv.children.length > 0)
		gmDiv = parentDiv.insertBefore(htmlContent.body.firstChild, parentDiv.children[0]);
	else
		gmDiv = parentDiv.appendChild(htmlContent.body.firstChild);

	for (var i in hp_gameModes) {
		addGameMode(i, gmDiv);
	}

	return 0;
}

