var updateLatestBetSet = function() {
	if (betToSetLater <= 0)
		return;

	var currentBet = CoinManager.GetNextTotalBet();
	while (currentBet > betToSetLater) {
		CoinManager.instance.GetSmartDecreasedBet(true);
		currentBet = CoinManager.GetNextTotalBet();
	}

	while (currentBet < betToSetLater) {
		CoinManager.instance.GetSmartIncreasedBet(true);
		currentBet = CoinManager.GetNextTotalBet();
	}

	betToSetLater = -1;
	updateBetValue();
}

var increaseBet = function() {
	if (settingSliders["Bet"] == undefined)
		return;
	var vals = settingSliders["Bet"].values;
	if (indexVals["Bet"] >= vals.length - 1)
		return;

	indexVals["Bet"]++;
	if (!isPaused || mustPause)
		betToSetLater = vals[indexVals["Bet"]];
	else {
		if (betToSetLater)
			updateLatestBetSet();
		CoinManager.instance.GetSmartIncreasedBet(true);
	}

	updateBetValue();
}

var decreaseBet = function() {
	if (settingSliders["Bet"] == undefined)
		return;
	if (indexVals["Bet"] <= 0)
		return;

	indexVals["Bet"]--;
	if (!isPaused || mustPause)
		betToSetLater = settingSliders["Bet"].values[indexVals["Bet"]];
	else {
		if (betToSetLater)
			updateLatestBetSet();

		CoinManager.instance.GetSmartDecreasedBet(true);
	}

	updateBetValue();
}

var updateBetValue = function() {
	if (!betValue)
		return;
	var bet;

	if (betToSetLater > 0)
		bet = betToSetLater;
	else
		bet = CoinManager.GetNextTotalBet();
	if (settingSliders["Bet"] != undefined)
		settingSliders["Bet"].update(bet);

	var newVal = LocaleManager.FormatValue(bet, new FormatOptions());
	if (betValue.innerHTML != newVal && isPaused == false)
		stopSession();

	betValue.innerHTML = newVal;
}

var updateSpinValue = function() {
	if (!spinsValue)
		return;

	var val;
	if (setupDone)
		val = currentSpinsCount[PROCESSED] + "/";
	else
		val = "";

	if (spins > maxSpins)
		val += '';
	else
		val += spins;

	if (settingSliders["Spins"] != undefined)
		settingSliders["Spins"].update(spins);

	spinText.innerHTML = hyperTexts.spin[langIDX] + " " + totalSpinsCount[PROCESSED];
	shrinkToFit(spinText, labelsToRefit["spinText"]);
	spinsValue.innerHTML = val;

	if (isSessionDone() && document.getElementById("PlayButton")) {
		stopSession();
	} else if (XT.GetInt(Vars.AutoplaySpinsLeft) > 0) {
		var spinsLeft = XT.GetInt(Vars.AutoplaySpinsLeft);
		if (currentSpinsCount[SPUN] + spinsLeft < spins) {
			console.log("HYPERPLAY: updateSpinValue. set AutoplaySpinsLeft to " + (spins - currentSpinsCount[SPUN]));
			XT.SetInt(Vars.AutoplaySpinsLeft, spins - currentSpinsCount[SPUN]);
		}
	}
}

var increaseSpins = function() {
	if (indexVals["Spins"] >= spinValues.length - 1)
		return;

	indexVals["Spins"]++;
	spins = spinValues[indexVals["Spins"]];

	if (spins > maxSpins)
		spins = maxSpins + 1;
	updateSpinValue();
}

var decreaseSpins = function() {
	if (indexVals["Spins"] <= 0)
		return;

	indexVals["Spins"]--;

	spins = spinValues[indexVals["Spins"]];

	updateSpinValue();
}

