var animEnabled = true;
var testIdx = 0;
var playWinAnimation = function(multiplier) {
	//animEnabled = false;
	if (!animEnabled)
		return;

	var multiplierIdx = 0;
	if (multiplier != undefined && multiplier > 0) {
		for (var i = 3; i >= 0; i--)
			if (multiplier > bigMultiplierLimits[i]) {
				multiplierIdx = i;
				break;
			}
	} else {
		multiplierIdx = testIdx;
		testIdx++;
		if (testIdx > 3)
			testIdx = 0;
	}

	// Create explosions at intervals
	var animX = canvas.width * 0.5;
	var animY = canvas.height + 50 * window.devicePixelRatio;
	var animStep = 0;
	HyperplaySound("coin_animation_" + multiplierIdx);
	for (var i = 0; i < 5; i++) {
		setTimeout( () => {
			createExplosion(animX, animY, multiplierIdx);
		}
		, animStep);
		animStep += 60;
	}
};

