var cleanUnfinishedRound = function() {
	responseQueue = [];
	spinTimer = -1;
	roundsToProcess = [];
	roundsCount[PROCESSED] = totalSpinsCount[SPUN];
	removeLine(0);
	removeLine(1);
	if (lastSpin != undefined && lastSpin.tumblingState == "TumbleEnd")
		onFirstCollapseDone(lastSpin, true, false);
	toggleFirstRow(lastSpin, true);

	var i = sessionData.length - 1;
	var startIndex = -1;

	for (; i >= 0; i--) {
		var data = sessionData[i];
		if (data.tumblingState == undefined)
			continue;

		if (data.freeSpinState == "" && (data.tumblingState == "" || data.tumblingState == "TumbleEnd"))
			break;

		if (data.freeSpinState != "") {
			startIndex = currentFSSEssion.index;
		} else
			startIndex = currentSession.index;

		break;
	}

	startIndex--;
	if (startIndex >= 0)
		for (; i >= startIndex; i--) {
			var data = sessionData[i];
			if (data.tumblingState == undefined)
				continue;

			if (table.contains(data.div))
				table.removeChild(data.div);
			sessionData.splice(i, 1);
		}

	spinIndex = sessionData.length + 1;
	latestSessionToCollapse = undefined;
	currentFSSEssion = undefined;
	currentSession = null;
	oldTumbleState = false;
	ready = [true, true, true, false];
}

var saveSession = false;
var closeHyperplay = function() {
	mustGetWinnings = false;

	hyperplayListener = null;
	var eventID;
	if (roundsCount[SPUN] == 0)
		eventID = "ClosedWithoutPlaying";
	else
		eventID = "Closed_After";
	globalTracking.SendEvent("uht_hyperplay", eventID, roundsCount[SPUN], "BehaviourTracker");

	window.removeEventListener("message", onMessageReceived);

	if (betToRestore > 0) {
		setBetToValue(betToRestore);
	}

	if (saveSession)
		cleanUnfinishedRound();
	restoreGame();

	if (!saveSession) {
		restoreOverridesOnClose();
		var hyperspin = document.getElementById("hyperspin");
		hyperspin.remove();
		resetHVars();
	}
}

