var OpenHyperplay = function(fromButton) {
	if (playingFeatureInGame) {
		playingFeatureInGame = false;
		requestWinnings();
		prepareGameForHyperspins();
		continueWithFeature();
		return;
	}

	if (inHyperplay)
		return;
	if (window["SystemMessageManager"]["IsMessageOpen"]())
		return false;
	if (XT.GetBool(Vars.FeaturePurchaseWindowIsOpen))
		return false;
	if (XT.GetBool(Vars.AnteBetWindowIsOpen))
		return false;
	if (CoinManager.isStrictMode)
		return;

	if (XT.GetBool(Vars.Logic_IsFreeSpin))
		return;
	var respinData = XT.GetObject(Vars.RespinData);
	var isNotRespin = respinData == null || respinData.IsDone;
	var canSpin = XT.GetBool(Vars.CanSpin) && isNotRespin;
	if (!canSpin)
		return;

	if (window["InterfaceController"]) {
		var interfaceContainer = globalRuntime.sceneRoots[1].GetComponentsInChildren(InterfaceController);
		if (interfaceContainer.length > 0) {
			var target = interfaceContainer[0].autoplayBtn.closed.GetComponent(ButtonEnabler).target;
			if (target) {
				var autoplayBtn = target.GetComponent(UIButton);
				if (autoplayBtn != undefined) {
					if (autoplayBtn.curState == 3)
						return;
				}
			}
		}
	}

	if (window["UHT_GAME_CONFIG"]["LANGUAGE"] != undefined) {
		langIDX = langIdxArr[window["UHT_GAME_CONFIG"]["LANGUAGE"]];
		if (langIDX == undefined) {
			langIDX = 0;
		}
	}

	var hyperspinEl = document.getElementById("hyperspin");
	if (hyperspinEl == undefined)
		resetHVars();

	window.inHyperplay = true;
	if (hyperspinEl == undefined)
		prepareSound();
	HyperplaySound("btn_click");
	globalTracking.SendEvent("uht_hyperplay", "Opened_FromButton", fromButton, "BehaviourTracker");

	setRowHeight();
	if (hyperspinEl == undefined) {
		injectHP();
		onUHTUpdate();
	} else {
		var currentBet = CoinManager.GetNextTotalBet();
		settingSliders["Bet"].update(currentBet);
		betValue.innerHTML = LocaleManager.FormatValue(currentBet, new FormatOptions());
		prepareGameForHyperspins();
		if (setupDone) {
			spinTimer = -1;
			removePauseRow();
			addStartCredit();
		}
	}

	//bigMultiplierLimits = [2, 3, 4, 5];
	limbo = saveSession;

	window.addEventListener("message", onMessageReceived);
	if (window != window.top && hyperplayListener == null)
		hyperplayListener = this;

}

