				HPVARS.pickStatus = HPVARS.FSPICK.REVEALED;

			if (HPVARS.mysteryPickIndex < 0 || typeof getFSRevealedLabel != 'function' || (HPVARS.onlyRevealMysteryIfPicked && (pickedOptionIndex != fsOptions.mysteryPickIndex))) {
				continueWithFeatureAfterTimeout(1000);
				return;
			}

			var pickableOption = fsOptions[HPVARS.fsItems][fsOptions.mysteryPickIndex];
			var text = getFSRevealedLabel(pickableOption);
			if (!HPVARS.onlyRevealMysteryIfPicked && text == mysteryLabelBefore)
				return;
			HPVARS.mysteryDiv.innerHTML = text;
			if (pickedOptionIndex == fsOptions.mysteryPickIndex)
				HPVARS.mysteryDiv.classList.remove("fadeOutTextBlack");
			else if (!HPVARS.onlyRevealMysteryIfPicked)
				HPVARS.mysteryDiv.classList.remove("fadeOutTextWhite");
			HPVARS.mysteryDiv.classList.add("pulse2");

			continueWithFeatureAfterTimeout(2000);
