	if (oTCL_HSP == null && window["TournamentConnectionXTLayer"]) {
		oTCL_HSP = TournamentConnectionXTLayer.prototype.HandleSpinResponse;
		TournamentConnectionXTLayer.prototype.HandleSpinResponse = function(dict) {
			if (!window.inHyperplay)
				return oTCL_HSP.apply(this, arguments);

			this.isPrizeDrop = false;
			var promoWinUID = "";
			var promoWinAmount = 0;
			var promoWinGift = "";
			var promoWinBet = 0;
			var promoWinMultiplier = 0;
			var promoWinPrizeType = TournamentProtocol.PrizeType.Invalid;
			var promoFreeRounds = "";
			var promoFreeRoundType = "N";
			var promoFreeRoundAmount = -1;
			var pdSegment = -1;
			var pdTotalSegments = -2;
			if (dict["ev"] != undefined) {
				var split = dict["ev"].split("~");
				if (split.length > 1 && split[0] == "MR") {
					split = split[1].split(",");
					if (split.length > 1) {
						var uid = PromotionsHelper.GetUID(_number.otoi(split[0]), TournamentProtocol.PromoType.Race);
						var promo = PromotionsHelper.FindPromotion(uid);
						var details = PromotionsHelper.FindDetails(uid);

						var WDText = "";
						if (details != null && details.type == "WD") {
							pdSegment = pdTotalSegments = details.prizeDropSegment.totalSegments;
							WDText = pdSegment + "/" + pdTotalSegments;
						}

						if (promo != null && promo.clientMode == TournamentProtocol.ClientMode.Visible) {

							var winTexts = [];
							if (split[1] == "A") {
								promoWinAmount = _number.otod(split[2]);
								lastPromoWin = promoWinAmount;
								winTexts.push(LocaleManager.FormatValue(promoWinAmount, new FormatOptions()));
							} else if (split[1] == "G") {
								promoWinGift = decodeURIComponent(atob(split[2]).split("").map(function(c) {
									return "%" + ("00" + c.charCodeAt(0).toString(16)).slice(-2)
								}).join(""));
								winTexts.push(promoWinGift);
							} else if (split[1] == "BM") {
								lastPromoWin = _number.otod(split[2]);
								promoWinAmount = LocaleManager.FormatValue(lastPromoWin, new FormatOptions());
								promoWinBet = LocaleManager.FormatValue(_number.otod(split[3]), new FormatOptions());
								promoWinMultiplier = _number.otoi(split[4]);
								winTexts.push(promoWinAmount + " = " + promoWinMultiplier + " x " + promoWinBet);
							} else if (split[1] == "FR") {

								promoWinBet = _number.otod(split[2]);
								promoFreeRoundType = split[3];
								var text = "";

								if (promoFreeRoundType == "F") {
									text = promoLabels["F"];
									if (text == undefined)
										text = "INSTANT BONUS";
								} else {
									promoFreeRoundAmount = _number.otoi(split[4]);
									var localLbl = promoLabels[promoFreeRoundType];

									if (localLbl == undefined) {
										if (promoFreeRoundType == "N")
											localLbl = " FREE BONUS SPINS";
										else if (promoFreeRoundType == "T")
											localLbl = " SECONDS OF FREE BONUS SPINS";
									}

									text = promoFreeRoundAmount + localLbl;
								}

								var betStr = LocaleManager.FormatValue(promoWinBet, new FormatOptions());
								winTexts.push(text + " (" + hyperTexts.bet[langIDX] + " " + betStr + ")");
								var availableGamesNames = details.freeRoundSettings["availableGameNames"];
								if (availableGamesNames == undefined || availableGamesNames.length == 0) {
									if (details.entryFeatureSettings)
										winTexts.push(details.entryFeatureSettings.availableGameName);
									else {//TO PLAY IN THIS GAME - not adding it
									}
								} else {
									for (var i in availableGamesNames) {
										winTexts.push(availableGamesNames[i]);
									}
								}

								// oTCL_HSP.apply(this, arguments);
								// closeHyperplay();
								// return;
							} else if (split[1] == "PS") {
								pdSegment = _number.otoi(split[2]);
								pdTotalSegments = _number.otoi(split[3]);
								if (pdSegment < pdTotalSegments && pdSegment > 0) {
									WDText = pdSegment + "/" + pdTotalSegments + " " + promoLabels["PIECES"];
									winTexts.push("");
								}
							} else
								WDText = null;

							if (WDText != null) {
								var leftText = "";
								//TODO use PROMO name
								var type = -1;
								if (WDText.length == 0) {
									type = PROMO_TYPES.PD;
								} else {
									if (pdTotalSegments >= promoSegmentsMapping.length)
										type = PROMO_TYPES.WD6;
										//shouldn't happen;
									else {
										if (promoSegmentsMapping[pdTotalSegments] == 8)
											type = PROMO_TYPES.WD8;
										else
											type = PROMO_TYPES.WD6;
									}

									leftText = WDText;
								}

								if (winTexts.length > 0 && winTexts[0].length != 0)
									stopSession();

								onPromoWin(type, leftText, winTexts);
							}
						}

						dict["ev"] = undefined;
						return;
					}
				}
			}

			oTCL_HSP.apply(this, arguments);
		}
	}

