var pauseAutospins = function(force) {
	if (!isSessionDone()) {
		if (isPaused || force) {
			//if (isPaused || (force && savedSpinsLeft < 0)) {
			//console.log("HYPERPLAY: ahead by "+ (roundsCount[SPUN] - roundsCount[PROCESSED]));
			savedSpinsLeft = XT.GetInt(Vars.AutoplaySpinsLeft);
			setReady(CHECK.AUTOSPIN);
			XT.SetInt(Vars.AutoplaySpinsLeft, -1);
		}

		return true;
	}

	return false;
}

var AutoplaySpinsLeftChanged = function(param) {
	//console.log("HYPERPLAY: AUTOSPINs left changed to " + param);
	if (param >= 0) {
		if (!isPaused && (param < 10 && spins > maxSpins)) {
			XT.SetInt(Vars.AutoplaySpinsLeft, maxSpins + 1);
			return;
		}

		if (pauseAutospins(roundsCount[SPUN] - roundsCount[PROCESSED] > 1))
			return;
	}

	if (isSessionDone() && document.getElementById("PlayButton")) {
		stopSession();
	}

	if (param < 0) {
		//console.log("HYPERPLAY: AUTOSPIN ended with spins done = " + currentSpinsCount[SPUN]);
		setReady(CHECK.AUTOSPIN);
	}
}

