//*
var tumbleWin = 0;
var lastTumbleMultiplier = 1;
var fakeSpinEnd = function(freeSpinState, winstr, tumblingState, tumbleMultiplier, balance, additionalSpins, rid) {
	if (rid) {
		var fox_response = XT.GetObject(FOXVars.FOX_Response);
		if (fox_response)
			fox_response.rid = rid;
		VerifyGameAuthenticityManager.rid = rid;
	}

	var win = 0;
	if (winstr != 0)
		win = (+winstr.substring(1));

	var tumble = (tumblingState == "TumbleStart") || (tumblingState == "Tumble")
	if (tumbleMultiplier != undefined && tumbleMultiplier > 1)
		lastTumbleMultiplier = tumbleMultiplier;

	if (lastTumbleMultiplier > 1 && tumblingState == "TumbleEnd") {
		tumbleWin = tumbleWin * lastTumbleMultiplier;
		XT.SetDouble(Vars.WinReceived, tumbleWin);
		tumbleWin = 0;
		lastTumbleMultiplier = 1;
	} else {
		XT.SetDouble(Vars.WinReceived, win);
		if (!tumble) {
			tumbleWin = 0;
		} else
			tumbleWin += win;
	}

	var freeSpin = freeSpinState != "";
	if (freeSpin) {
		var fsr = new FreeSpinsResponse();

		fsr._isFreeSpinsStart = freeSpinState == "FreeSpinsStart";
		if (fsr._isFreeSpinsStart) {
			if (additionalSpins == undefined)
				additionalSpins = 15;
			fsr._maxSpins = additionalSpins;
		} else if (additionalSpins != undefined && additionalSpins > 0)
			fsr._additionalSpins = additionalSpins;

		fsr._isFreeSpin = true;
		if (freeSpinState == "LastFreeSpin")
			fsr.TotalSpins = 1;
		else
			fsr.TotalSpins = 0;

		XT.SetObject(Vars.ReceivedFreeSpinsResponse, fsr);
	} else {
		var fsr = XT.GetObject(Vars.ReceivedFreeSpinsResponse);
		fsr._isFreeSpinsStart = false;
		fsr._isFreeSpin = false;
		XT.SetObject(Vars.ReceivedFreeSpinsResponse, fsr);

		XT.SetDouble(Vars.SpinCycleWinReceived, win);
	}

	XT.SetBool(Vars.IsDifferentSpinType, tumble);

	if (balance != undefined && balance.length > 0) {
		balance = balance.substring(1)
		balance = balance.replaceAll(",", "");
		XT.SetDouble(Vars.BalanceReceived, +balance);
	}

	UHTInterfaceBOSS.PostMessage("spinEnded");

	if ((!freeSpin && !tumble) || (freeSpinState == "LastFreeSpin"))
		UHTInterfaceBOSS.PostMessage("gameRoundEnded");

};

